var book = {
	"name": "Dagiti Proverbio",
	"numChapters": 31,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> Dagiti proverbios ni Salomon nga anac ni David, ari ti Israel:",
			"2": "<sup>2</sup> Ti panangammo iti kinasirib ken sursuro; ti panangilasin cadagiti sasao ti pannacaawat;",
			"3": "<sup>3</sup> Ti panangawat iti sursuro iti nanacman a cababalin, iti kinalinteg ken kinajusticia ken panagpapada;",
			"4": "<sup>4</sup> Ti pannangted iti kinamanakem cadagiti nanengneng, iti bumaro pannacaammo ken kinaannad:",
			"5": "<sup>5</sup> Tapno ti masirib a tao dumngeg coma, ket dumegdeg iti pannacasursuro; ken tapno ti tao a mannacaawat magawatna coma dagiti naingundawayan a patpatigmaan:",
			"6": "<sup>6</sup> Ti panangawat iti proverbio, ken pangngarig, dagiti sasao dagiti masirib, ken dagiti nauneg a panagsaoda.",
			"7": "<sup>7</sup> Ti panagbuteng ken ni Jehova isu ti punganay ti pannacaammo; ngem dagiti maag laisenda ti sirib ken sursuro.",
			"8": "<sup>8</sup> Anacco, denggem ti pannursuro toy amam, ket dica bay-an ti linteg ni inam:",
			"9": "<sup>9</sup> Ta isudanto ti balangat ti saniata dita olom, ken calangcang a mayuccor dita tengngedmo.",
			"10": "<sup>10</sup> Anacco, no dagiti managbasol sulisogendaca, dica umanamong cadacuada.",
			"11": "<sup>11</sup> No cunada, Cumuyogca cadacami, intayo sumaneb iti dara; intayo siblocan a sililimed dagiti awan basolda iti awan gapgapuna;",
			"12": "<sup>12</sup> Intayo alun-unen ida a sibibiag a cas ken Tanem, ken sibubukel, a cas cadagiti agpababa iti abut;",
			"13": "<sup>13</sup> Masaracantayto amin a napateg a sanicua; punnoentayto dagiti balbalaytayo iti sinamsam;",
			"14": "<sup>14</sup> Maipaaymonto ti gasatmo cadacami; addanto cadatayo amin ti maymaysa a supot:",
			"15": "<sup>15</sup> Anacco, dica makicuyog iti dalan cadacuada; tenglem ta sacam iti desdesda:",
			"16": "<sup>16</sup> Ta dagiti sacsacada agtarayda iti dakes, ken agdarasda a mangibuyat iti dara.",
			"17": "<sup>17</sup> Ta barengbareng ti pannacaipacat ti iket iti imatang ti aniaman a tumatayab:",
			"18": "<sup>18</sup> Ket dagitoy sanebenda ti darada met laeng; siblocanda a sililimed dagiti biagda met laeng.",
			"19": "<sup>19</sup> Casta dagiti daldalan ti siasinoman a siaagum iti gungunaen; iccatenna ti biag dagiti akincucua.",
			"20": "<sup>20</sup> Ni sirib agpucpuccaw iti lansangan; iyebcasna ti timecna cadagiti nawaya a yan;",
			"21": "<sup>21</sup> Aglaaw iti nangrona a yan ti pagdadagupan; iti wangawangan dagiti ruruangan, iti uneg ti ili, ibalicasna dagiti saona:",
			"22": "<sup>22</sup> Casano ti capaut ti panangayatyonto iti kinanengneng, dacayo a nanengneng? Ket dagiti managuyaw, ken panaggura dagiti maag iti pannacaammo?",
			"23": "<sup>23</sup> Taliawenyo cadi toy panangtubngarco: Adtoy, iparucpocconto ti espirituc cadacayo; ipacaammocto dagiti saoc cadacayo.",
			"24": "<sup>24</sup> Gapu ta immayabac, ket nagmadicayo; inunnatco ti imac, ket awan tao a nangicascaso;",
			"25": "<sup>25</sup> Ngem inawawanyo amin a pammagbagac, ket nagmadicayo iti panangtubngarco:",
			"26": "<sup>26</sup> Agcatawaacto met intono pannacadidigrayo; agrabrabacacto intono dumteng ti panagbutengyo;",
			"27": "<sup>27</sup> Intono ti panagbutengyo dumteng a cas bagio, ken ti didigrayo dumteng a cas alipugpog; intono dumteng cadacayo da senaay ken ladingit.",
			"28": "<sup>28</sup> Iti casta awagandacto, ngem diacto sumungbat; birukendacto a sigaganetget, ngem didacto masaracan:",
			"29": "<sup>29</sup> Agsipud ta ginurada ti pannacaammo, ket saanda a pinili ti panagbuteng ken ni Jehova:",
			"30": "<sup>30</sup> Nagmadida iti pammagbagac; linaisda amin a panangtubngarco:",
			"31": "<sup>31</sup> Gapuna canendanto ti bunga ti cababalinda met laeng, ken mapnodanto cadagiti ing-ingpenda met laeng.",
			"32": "<sup>32</sup> Ta ti pannacapasanud dagiti nanengneng papatayennanto ida, ken ti naliway a nam-ay dagiti maag pucawennanto ida.",
			"33": "<sup>33</sup> Ngem siasinoman a mangipangag caniac agtalinaedto a sitatalged, ket sitatalnanto nga awan butengna iti dakes."
		},
		"2": {
			"1": "<sup>1</sup> Anacco, no awatemto dagiti saoc, ket ipenpenmo kenca dagiti bilinco;",
			"2": "<sup>2</sup> Iti casta iyallingagmo ta lapayagmo iti kinasirib, ken icapetmo ita pusom iti panacaawat;",
			"3": "<sup>3</sup> Wen, awagam ti kinasaririt; ket idir-im ta timecmo a maipaay iti pannacaawat;",
			"4": "<sup>4</sup> No isu birukem a cas pirac, ken tontonem a cas nalmeng a gamgameng:",
			"5": "<sup>5</sup> Iti casta maawatamto ti panagbuteng ken ni Jehova, ken masaracamto ti pannacaammo iti Dios.",
			"6": "<sup>6</sup> Ta ni Jehova mangted iti sirib; agtaud iti ngiwatna ti pannacaammo ken pannacaawat:",
			"7": "<sup>7</sup> Ipenpenna iti natarnaw a sirib a maipaay iti nalinteg;   isu ti calasag dagiti magna iti kinaimbag,",
			"8": "<sup>8</sup> Tapno mabantayanna dagiti dandana ti kinajusticia, ken masalacnibanna ti dalan dagiti sasantona.",
			"9": "<sup>9</sup> Iti casta maawatamto ti kinalinteg ken kinajusticia, ken ti kinaagpapada, wen, tunggal naimbag a dana.",
			"10": "<sup>10</sup> Ta ti sirib sumrecto dita pusom, ket ti pannacaammo macaay-ayonto ita cararuam;",
			"11": "<sup>11</sup> Ti kinaannad salluadannacanto; ti pannacaawat igaganacanto:",
			"12": "<sup>12</sup> Tapno ilisidaca iti dalan ti dakes, cadagiti tattao nga agsao cadagiti naulpit a banbanag;",
			"13": "<sup>13</sup> Isuda a mangbaybay-an cadagiti dana ti kinalinteg, tapno magnada cadagiti dalan ti kinasipnget;",
			"14": "<sup>14</sup> Isuda a maragsacan nga agaramid iti dakes, ken marayray-aw iti kinaulpit ti dakes;",
			"15": "<sup>15</sup> Isuda a nakillo cadagiti dalanda, ken sisusungitda cadagiti desdesda:",
			"16": "<sup>16</sup> Tapno ilisidaca iti gangannaet a babai, wen, iti gangannaet a mangpasablog babaen cadagiti saona;",
			"17": "<sup>17</sup> A baybay-anna ti gayyem ti kinabalasangna, ken lipatenna ti tulag ti Diosna:",
			"18": "<sup>18</sup> Ta ti balayna agirig ken patay, ket dagiti desdesna agturongda cadagiti natay;",
			"19": "<sup>19</sup> Siasinoman a mapan kencuana dida agsublin, dida met magun-odanen dagiti dandana ti biag:",
			"20": "<sup>20</sup> Tapno macapagnaca iti dalan dagiti naimbag a tattao, ken mataginayonmo dagiti dandana dagiti nalinteg.",
			"21": "<sup>21</sup> Ta ti nalinteg agtalinaedto ditoy daga, ket ti napnoan-imbag agtaengto kencuana.",
			"22": "<sup>22</sup> Ngem dagiti nadangkes magudasdanto ditoy daga, ket dagiti nagulib maparutdanto kencuana."
		},
		"3": {
			"1": "<sup>1</sup> Anacco, dica lipaten ti lintegco ngem salimetmetam coma dita pusom dagiti bilbilinco:",
			"2": "<sup>2</sup> Ta inayondanto kenca ti caatiddug dagiti aldaw, ken tawtawen ti panagbiag, ken ti talna.",
			"3": "<sup>3</sup> Da kinamanagayat ken pudno didaca coma baybay-an: yuccormo ida ita tengngedmo; isuratmo ida iti tapi ta pusom:",
			"4": "<sup>4</sup> Iti casta masaracamto ti parabur ken naimbag a pannacaawat iti imatang ti Dios ken ti tao.",
			"5": "<sup>5</sup> Agtalecca ken ni Jehova iti amin a pusom, ket dica agtal-ged iti pannacaawatmo met laeng:",
			"6": "<sup>6</sup> Cadagiti amin a dalanmo isu ti bigbigem, ket isu iturongnanto dagiti desdesmo.",
			"7": "<sup>7</sup> Saanca coma a masirib cadagita matam met laeng; agbutengca ken Jehova, ket pagtalawam ti dakes:",
			"8": "<sup>8</sup> Isunto ti salun-at ta pusegmo, ken pata cadagita tultulangmo.",
			"9": "<sup>9</sup> Pagdayawmo ti cucuam ken Jehova, ken dagiti umuna a bungbunga ti amin a maapitmo:",
			"10": "<sup>10</sup> Iti casta dagiti sarusarmo mapnodanto a sipupusec, ket dagiti baldem agliplippiasdanto iti baro nga arac.",
			"11": "<sup>11</sup> Anacco, dica laisen ti pammagbaga ni Jehova; dica met mauma iti panangtubngarna;",
			"12": "<sup>12</sup> Ta ti ayayaten ni Jehova tubngarenna; cas met laeng maysa nga ama iti anacna a pagayayatanna.",
			"13": "<sup>13</sup> Naragsac ti tao a macasarac iti sirib, ken ti tao a macaala iti pannacaawat.",
			"14": "<sup>14</sup> Ta ti pannacagun-od kencuana nasaysayaat ngem pannacagun-od iti pirac, ket ti magunguna kencuana nasaysayaat ngem balitoc a nasudi.",
			"15": "<sup>15</sup> Napatpateg ngem dagiti rubis: ket awan cadagiti banbanag a mabalinmo a tarigagayan ti mayasping kencuana.",
			"16": "<sup>16</sup> Ti caatiddug dagiti al-aldaw adda iti imana a canawan; iti imana a catigid adda dagiti kinabacnang ken dayaw.",
			"17": "<sup>17</sup> Dagiti dalanna dalan ida a nacay-ayo, ket amin a danana natalna.",
			"18": "<sup>18</sup> Isu ti cayo ti biag cadagiti cumpet kencuana: ket naragsac ti siasinoman a mangsalimetmet kencuana.",
			"19": "<sup>19</sup> Ni Jehova iti siribna binangonna ti daga; iti pannacaawat pinatacderna dagiti langlangit,",
			"20": "<sup>20</sup> Iti pannacaammona dagiti yuyeng nagungatda, ket dagiti tangatang nagtedtedda iti linnaaw.",
			"21": "<sup>21</sup> Anacco, dida cadi pumanaw cadagita matam; salimetmetam ti natarnaw a kinasirib ken kinaannad:",
			"22": "<sup>22</sup> Iti casta isudanto ti biag ita cararuam, ken saniata ita tengngedmo.",
			"23": "<sup>23</sup> Iti casta magnacanto iti dalanmo a sitatalged, ket ti sacam dinto maitibcol.",
			"24": "<sup>24</sup> Intono agiddaca, dicanto agbuteng: wen, agiddacanto, ket ti turogmo nasam-itto.",
			"25": "<sup>25</sup> Dica agbuteng iti kellaat a pagbutngan, casta met iti pannacarebbec dagiti nadangkes, intono dumteng:",
			"26": "<sup>26</sup> Ta ni Jehova isunto ti catalecmo, ket saluadannanto ta sacam iti pannacatiliwna.",
			"27": "<sup>27</sup> Dica medmedan ti imbag cadagiti carbenganna, no adda ita imam iti pannacabalin a mangaramid.",
			"28": "<sup>28</sup> Dica cunaen iti caarrubam, Incan, ket baliwam ti umay, ket intono bigat ti panangtedco: no adda kenca ita iti biangmo.",
			"29": "<sup>29</sup> Dica panggepen ti dakes a maibusor iti caarrubam nga agbiag a sitatalna iti sibaymo.",
			"30": "<sup>30</sup> Dica caringgor ti maysa a tao nga awan gapuna, no awan ti ranggas nga inaramidna kenca.",
			"31": "<sup>31</sup> Dica apalan ti tao a nauyong, ket dica pilien ti uray ania cadagiti daldalanna.",
			"32": "<sup>32</sup> Ta ti naulpit maysa a macarimon ken Jehova; Ngem ti pannakipagayamna adda cadagiti nalinteg.",
			"33": "<sup>33</sup> Ti panangilunod ni Jehova adda iti balay dagiti nadangkes; ngem bendicionanna ti pagnaedan dagiti nalinteg.",
			"34": "<sup>34</sup> Pudno nga umsienna dagiti managumsi; ngem itdenna ti parabur iti napacumbaba.",
			"35": "<sup>35</sup> Ti masirib tawidennanto ti dayaw; ngem ti bain isunto ti magunguna dagiti maag."
		},
		"4": {
			"1": "<sup>1</sup> Denggenyo, annacco, ti panangisuro ti maysa nga ama, ket imatanganyo tapno maammoanyo iti pannacaawat:",
			"2": "<sup>2</sup> Ta iccancayo iti naimbag a sursuro; dicayo baybay-an ti lintegco.",
			"3": "<sup>3</sup> Ta maysaac idi nga anac ni amac, nadungdungngo ken cacaisuna nga ayayaten ni inac.",
			"4": "<sup>4</sup> Ket insursuronac, ken kinunana caniac; agtalinaed cadi ita pusom dagiti sasaoc; salimetmetam dagiti bilbilinco, ket agbiagca;",
			"5": "<sup>5</sup> Gun-odem ti sirib, gun-odem ti pannacaawat; dica aglipat, dica met agligsay cadagiti sasao ti ngiwatco;",
			"6": "<sup>6</sup> Dica baybay-an, ket isu ti mangsalacnibto kenca; ayatem ket saluadannacanto.",
			"7": "<sup>7</sup> Ti sirib isu ti cangronaan a banag, gun-odem ngarud ti sirib; wen, cadagiti amin a gungun-odem gun-odem ti pannacaawat.",
			"8": "<sup>8</sup> Itantan-ocmo, ket isu ipangatonacanto; ipannacanto iti kinadayaw, intono isu aracupem.",
			"9": "<sup>9</sup> Iccannanto ta olom iti balangat ti saniata; balangat ti kinapintas ti iyawatnanto kenca.",
			"10": "<sup>10</sup> Denggem, O anacco, ket awatem dagiti panagsaoc ket dagiti tawen ti panagbiagmo adudanto.",
			"11": "<sup>11</sup> Insurocan iti dalan ti sirib; inturongcan cadagiti dana ti kinalinteg.",
			"12": "<sup>12</sup> Intono magnaca, dagiti addangmo saandanto a masingsinged; ket no agatrayca, dicanto maitibcol.",
			"13": "<sup>13</sup> Irutem a petpetan ni sursuro; dica palubosan: salimetmetam; ta isu ti biagmo.",
			"14": "<sup>14</sup> Dica sumrec iti dana dagiti nadangkes, ket dica umasac iti dalan dagiti dakes a tattao.",
			"15": "<sup>15</sup> Liclicam, dica lumasat kencuana; sumiasica kencuana, ket magnacan.",
			"16": "<sup>16</sup> Ta dida maturog, no saanda pay a macaaramid iti dakes; ket ti turogda umadayo, no awan ti mapadsoda.",
			"17": "<sup>17</sup> Ta tinapay ti kinadangkes ti canenda, ket arac ti kinauyong ti inumenda.",
			"18": "<sup>18</sup> Ngem ti dana ti nalinteg cas iti annaraar ti agsapa, a rumaniag a rumaniag agingga iti napaypayso nga aldaw.",
			"19": "<sup>19</sup> Ti dalan ti nadangkes cas iti kinasipnget: dida ammo no ania ti pacaitibcolanda.",
			"20": "<sup>20</sup> Anacco, imdengam dagiti saoc; iyallingagmo ta lapayagmo cadagiti panagsaoc.",
			"21": "<sup>21</sup> Dica paluspusan ida a pumanaw cadagita matam; salimetmetam ida iti tengnga ta pusom.",
			"22": "<sup>22</sup> Ta isuda ti biag cadagiti macasarac cadacuada, ket salun-at iti amin a lasagda.",
			"23": "<sup>23</sup> Igagam ta pusom iti amin a regtam; ta aggapu kencuana dagiti pagbanagan ti biag.",
			"24": "<sup>24</sup> Iwalinmo kenca ti nabassawang a ngiwat, ken dagiti nagulib a bibig yadayom kenca.",
			"25": "<sup>25</sup> Dagiti matam cumitada cadi nga aglinteg laeng, ket dagita calub ti matam sililinteg cadi ti turongda dita sangoanam.",
			"26": "<sup>26</sup> Palanasem ti pagnaan dagita sacsacam, ket dagiti amin a daldalanmo nasimpada coma.",
			"27": "<sup>27</sup> Dica sumiasi iti macanawan wenno iti macatigid: ilisim dagiti sacsacam iti dakes."
		},
		"5": {
			"1": "<sup>1</sup> Anacco, imatangam ti kinasiribco; iyallingagmo ta lapayagmo iti pannacaawatco:",
			"2": "<sup>2</sup> Tapno masalacnibam ti kinamanakem ken dagiti bibigmo masalimetmetanda ti pannacaammo.",
			"3": "<sup>3</sup> Ta dagiti bibig ti manangallilaw a babai agtedtedda iti diro, ket ti ngiwatna nalamlamuyot ngem lana:",
			"4": "<sup>4</sup> Ngem iti panungpalan napait a cas iti mula nga ajinco, natadem a cas campilan a dua ti tademna.",
			"5": "<sup>5</sup> Dagiti sacana agpababada ken patay; dagiti addangna maicapetda ken Tanem;",
			"6": "<sup>6</sup> Iti casta isu dina saraken ti napalanas a dalan ti biag; dagiti dalanna aglikiglikigda, ket saana a mabigbig.",
			"7": "<sup>7</sup> Ita ngarud, annacco, dumngegcayo caniac, ket dicayo pagtalawan dagiti sasao ti ngiwatco.",
			"8": "<sup>8</sup> Ilisim ti dalanmo iti adayu kencuana, ket dica umasideg iti ruangan ti balayna;",
			"9": "<sup>9</sup> Di la ket ta maitedmo ta dayawmo cadagiti sabsabali, ken dagiti tawenmo iti nadawel;",
			"10": "<sup>10</sup> Di la ket ta dagiti gangannaet agpennecda ita pigsam, ket dagiti pagbannogam mararitda iti balay ti gangannaet,",
			"11": "<sup>11</sup> Ket sica agladingitca iti camaudianan a tungpalmo, intono ti lasagmo ken ti bagim marunotda,",
			"12": "<sup>12</sup> Ket macunamto, Apay aya a ginurac idi ti sursuro, ken toy pusoc linaisna ti pannacatubngar;",
			"13": "<sup>13</sup> Ken iti diac panagtulnog idi iti timec dagiti manursuro caniac, ken diac met panangyallingag itoy lapayagco cadagidi nangisuro caniac!",
			"14": "<sup>14</sup> Nganngani nairamanac ti amin a dakes iti tengnga ti gimong ken tallaong.",
			"15": "<sup>15</sup> Uminumca iti danum cadagiti tangkem met laeng, ken tumbog a danum cadagiti bubonmo met laeng.",
			"16": "<sup>16</sup> Maiparbeng aya nga agwarasto coma ti danum cadagiti calcalsada?",
			"17": "<sup>17</sup> Maipaayda coma kenca laeng, a saan ket a cadagiti gangannaet a naicuyog kenca.",
			"18": "<sup>18</sup> Mabendicionan coma ti ubbogmo; ket pagrag-oam ti asawa ti kinaagtutubom.",
			"19": "<sup>19</sup> Cas naayat a caba-ian nga ugsa, ket macaayayo nga ugsa a caba-ian, dagiti barucongna pennekendaca coma a cancanayon; ket macayawanca coma nga agnanayon iti ayatna.",
			"20": "<sup>20</sup> Ta apay, anacco, a macayawancanto iti babai a gangannaet, ken aracupemto ti barucong ti gangannaet?",
			"21": "<sup>21</sup> Ta dagiti daldalan ti tao addada iti saclang dagiti mata ni Jehova; ket palanasenna dagiti amin a pagnaanna.",
			"22": "<sup>22</sup> Dagiti kinadakesna met laeng kemmegendanto ti nadangkes, ket matengngelto cadagiti singdan ti basolna.",
			"23": "<sup>23</sup> Matayto gapu ti caawan ti sursuro; ket iti cadackel ti kinamaagna maiwawanto."
		},
		"6": {
			"1": "<sup>1</sup> Anacco, no nagbalinca a talged iti caarrubam, no inyunnatmo dagiti im-imam a maipaay ti maysa a gangannaet;",
			"2": "<sup>2</sup> Nasiloancan cadagiti sasao ta ngiwatmo, natiliwcan cadagiti sasao ta ngiwatmo.",
			"3": "<sup>3</sup> Aramidem daytoy ita, anacco, ket ispalem ta biangmo met laeng, idinto a dimtengcan iti ima ti caarrubam: inca, agpacumbabaca, ket ud-udam ti caarrubam;",
			"4": "<sup>4</sup> Dica paturogen dagiti matam, ken dica met pagridepen dagiti calub ti matam;",
			"5": "<sup>5</sup> Lumapsutca a cas ti kigaw iti ima ti mangnganup, ken cas la tumatayab iti ima ti mannilo.",
			"6": "<sup>6</sup> Inca ken coton, sica a nasadut; utobem dagiti daldalanna, ket sumiribca:",
			"7": "<sup>7</sup> Isu nga idinto nga awan pangulona, mangaywan man, wenno agturay,",
			"8": "<sup>8</sup> Saganaenna ti canenna iti calgaw, agurnong iti taraonna iti panagani.",
			"9": "<sup>9</sup> Casano ti cabayag ti panagturogmo, O sadut? Caano ti ibabangonmonto ita turogmo?",
			"10": "<sup>10</sup> Ala pay bassit a turog, bassit a ridep, bassit a panagdalikepkep dagiti im-ima tapno macaturogca:",
			"11": "<sup>11</sup> Iti casta dumtengto ti kinapanglawmo a cas mannanacaw, ken ti pannacasapulmo unay a cas nagtagiigam a tao,",
			"12": "<sup>12</sup> Awan cais-iscanna a tao, tao ti kinadangkes, daydiay magna a siuulpit ti ngiwatna;",
			"13": "<sup>13</sup> Nga agkiddakidday cadagiti matana, nga agsao cadagiti sacana, nga agsenas cadagiti ramramayna;",
			"14": "<sup>14</sup> Nga iti pusona adda kinaulpit, isu a segsegpenna a cancanayon ti dakes, nga agiwara iti panagririri.",
			"15": "<sup>15</sup> Gapuna ti pacarigatanna dumtengto a kellaat; makellaatto a madadael, ket iti dayta awanto ti pamuspusanen.",
			"16": "<sup>16</sup> Adda innem a banag a guraen ni Jehova; wen, pito dagiti macarimon kencuana.",
			"17": "<sup>17</sup> Natangsit a matmata, naulbod a dila, ken im-ima a mangibuyat iti dara nga awan basolna;",
			"18": "<sup>18</sup> Puso nga agpacpakinakem cadagiti nadangkes a panggepen, sacsaca a nacarting a tumaray iti panangranggas,",
			"19": "<sup>19</sup> Natiri a sacsi nga agbalicas iti ulbod, ken ti agmula iti riri cadagiti agcacabsat.",
			"20": "<sup>20</sup> Anacco, salimetmetam dagiti bilbilin ni amam, ket dica baybay-an ti linteg ni inam:",
			"21": "<sup>21</sup> Igalutmo ida a cancanayon ita pusom; iyuccormo ida ita tengngedmo.",
			"22": "<sup>22</sup> No magnaca, idalannacanto; no maturogca, agbantayto kenca; ket no macariingca, makisaritanto kenca.",
			"23": "<sup>23</sup> Ta ti pagbilinan isu ti pagsilawan; ket ti linteg isu ti silaw; ket dagiti panangtubngar ti sursuro isuda ti dalan ti biag:",
			"24": "<sup>24</sup> Tapno saluadandaca iti dakes a babai; iti pasablog ti dila ti gangannaet.",
			"25": "<sup>25</sup> Dica garteman ti sayaatna ita pusom; dica met ituloc nga alaennaca cadagiti calub ti matana.",
			"26": "<sup>26</sup> Ta maipuon iti maysa a balangcantis ti lalaki pagpatinggaannanto ti sangcapisi a tinapay; ket ti makicamalala a babai anupenna ti napateg a biag.",
			"27": "<sup>27</sup> Mabalin aya ti maysa a tao ti agsaclut iti apuy, ket saan a mauram dagiti pagan-anayna?",
			"28": "<sup>28</sup> Wenno adda macabalin a magna iti rabaw dagiti nabara a beggang, ket saan a masinit dagiti sacsacana?",
			"29": "<sup>29</sup> Casta ti sumrec iti asawa ti caarrubana; siasinoman a mangtignay kencuana saanto a di madusa.",
			"30": "<sup>30</sup> Dagiti tattao saanda nga umsien ti mannanacaw, no agtacaw tapno agpennec, no mabisin:",
			"31": "<sup>31</sup> Ngem no masalamaan, isublinanto ti maminpito; itednanto amin a sanicta iti balayna.",
			"32": "<sup>32</sup> Ti makicamalala iti maysa a babai awan ti pannacaawatna: daydiay agaramid iti casta cayatna a dadaelen ti cararuana met laeng.",
			"33": "<sup>33</sup> Sugsugat ken pannacaibabain ti magun-odnanto; ket ti pannacauy-uyawna dinto mapunasan.",
			"34": "<sup>34</sup> Ta ni imon isu ti kinarungsot ti lalaki; ket dinanto iliclic iti aldaw ti pammales.",
			"35": "<sup>35</sup> Dinanto taliawen ti aniaman a pangsubbot; dinto met agtalna a malinglingay, uray iccam iti adu a sagsagut."
		},
		"7": {
			"1": "<sup>1</sup> Anacco, salimetmetam dagiti sasaoc, ket icutam dagiti bilbilinco kenca.",
			"2": "<sup>2</sup> Salimetmetam dagiti bilbilinco ket agbiagca; ken ti lintegco a cas iti bukel ta matam.",
			"3": "<sup>3</sup> Ireppetmo ida cadagita ramramaymo; isuratmo ida iti tapi ta pusom.",
			"4": "<sup>4</sup> Cunaem ken kinasirib, Sica ti babai a cabsatco; ket ni pannacaawat naganem a cabagiam nga ingam:",
			"5": "<sup>5</sup> Tapno masaluadandaca iti babai a gangannaet, iti gangannaet a mangpasablog cadagiti sasaona.",
			"6": "<sup>6</sup> Ta iti tawa ti balayco simmiripac iti rejas;",
			"7": "<sup>7</sup> Ket namatmatac cadagiti nanengneng, nalasinco cadagiti bumbumaro, ti maysa nga agtutubo a lalaki nga awanan iti pannacaawat,",
			"8": "<sup>8</sup> Nga aglasat iti lansangan iti sibay daydiay a babai; ket napan iti dalan nga agturong iti balayna,",
			"9": "<sup>9</sup> Iti agsuripet ti malem, iti sardam iti cangitingit ti rabii ken iti kinasipnget.",
			"10": "<sup>10</sup> Ket, adtoy, idiay sinabet ti maysa a babai a binabalangcantis ti cawesna, ken sisisicap ti pusona.",
			"11": "<sup>11</sup> (Naariwawa ken managipapilit; dagiti sacsacana dida agtaeng idiay balayna:",
			"12": "<sup>12</sup> Adda cadagiti calsada ita, pagammoan cadagiti plasa, ket agsaneb tunggal nagsulian.)",
			"13": "<sup>13</sup> Idi a casta isu kinemmegna, ket inongngoanna, ket iti nagaramugam a rupana kinunana kencuana:",
			"14": "<sup>14</sup> Sacrificio dagiti datdaton ti cappia addada caniac; ita nga aldaw binayadacon dagiti carcaric.",
			"15": "<sup>15</sup> Gapuna immayac a manarac kenca, mangbiruc a sireregta ita rupam, ket nasaracancan.",
			"16": "<sup>16</sup> Inyucradco ti pagiddaac a naapaan, cadagiti luplupotpa naggarit nga abel sadi Egipto.",
			"17": "<sup>17</sup> Binangbangloac ti iddac iti mirra, aloe, ken canela.",
			"18": "<sup>18</sup> Umayca, agpennecta iti ayan-ayat inggana iti bigat; aglinglingayta iti ayayat.",
			"19": "<sup>19</sup> Ta ti lalaki awan ditoy balay; napan iti atiddug a pannagna:",
			"20": "<sup>20</sup> Nangicuyog iti sangasupot a pirac; dumtengto ditoy balay intono cabus.",
			"21": "<sup>21</sup> Iti adu a macaayayo a sarsaritana mapagtulocna; iti panangpasablog dagiti bibigna mapilitna.",
			"22": "<sup>22</sup> Ti lalaki sumuroten kencuana a masingsingdat a cas vaca a maipan iti pagpartian. Wenno cas maysa a nacawaran a mapan iti pacadusaan ti maag:",
			"23": "<sup>23</sup> Agingga ti maysa a pana salbagenna ti dalemna; cas maysa a tumatayab nga agdarasudos iti silo, ket dina ipagarup a maicaniwas iti biagna.",
			"24": "<sup>24</sup> Ita ngarud, annacco, dumngegcayo caniac, ket imdenganyo dagiti sasao ti ngiwatco.",
			"25": "<sup>25</sup> Dayta pusom saan coma nga agduyus cadagiti dalanna; dica coma mayawawan cadagiti danana.",
			"26": "<sup>26</sup> Ta isu adun ti impasagna a nasugat; wen, dagiti pinapatayna casla nawadwad a buyot.",
			"27": "<sup>27</sup> Ti balayna isu ti dalan nga agturong ken Tanem, nga agpababa cadagiti silsiled ni patay."
		},
		"8": {
			"1": "<sup>1</sup> Saan aya nga agpucpuccaw ni sirib, ken agtimtimec ni pannacaawat?",
			"2": "<sup>2</sup> Iti tapaw dagiti natayag a disso nga asideg iti dalan, nga pagtutugmucan dagiti dandana, isu agtatacder.",
			"3": "<sup>3</sup> Iti denna dagiti ruruangan, iti pagsercan ti ili, iti pagsercan cadagiti ruruangan, isu agpuccaw a sipipigsa:",
			"4": "<sup>4</sup> Cadacayo, O tattao, umayabac; ket ti timecco maipaay cadagiti annac dagiti tattao.",
			"5": "<sup>5</sup> O dacayo a nanengneng, awatenyo ti kinamanakem; ket, dacayo a maag, agmannacaawat cadi ta pusoyo.",
			"6": "<sup>6</sup> Denggenyo, ta agsaoac cadagiti mangnibinibi a banbanag; ken ti panaglucat dagiti bibigco nalintegto a banag.",
			"7": "<sup>7</sup> Ta ti ngiwatco agbalicasto iti kinapudno; ket ti kinadangkes isu ti macarimon cadagiti bibigco.",
			"8": "<sup>8</sup> Amin dagiti sasao ti ngiwatco addada iti kinalinteg; awan aniaman a kiwer wenno naulpit cadacuada.",
			"9": "<sup>9</sup> Biigda a nabatad iti macaawat, ken nalintegda cadagiti macasarac iti pannacaammo.",
			"10": "<sup>10</sup> Awatenyo ti pannursuroc, a saan ketdi a ti pirac; ken ti pannacaammo, a nangnangrona ngem ti balitoc a napili.",
			"11": "<sup>11</sup> Ta ti sirib napatpateg ngem dagiti rubrubi; ket amin dagiti cucua a mabalin a tarigagayan saanda a maipadpad kencuana.",
			"12": "<sup>12</sup> Siac ni sirib pinagbalinco ni kinamanakem a pagtaengac, ken sarakec da pannacaammo ken kinaannad.",
			"13": "<sup>13</sup> Ti panagbuteng ken ni Jehova isu ti pananggura iti dakes: tangsit, cuspag, ken ti dakes a dalan, ken ti naulpit a ngiwat, guraec.",
			"14": "<sup>14</sup> Ti patigmaan biangco, ken naimbag a pannacaammo: siac ti pannacaawat; adda caniac ti pannacabalin.",
			"15": "<sup>15</sup> Gapu caniac agari dagiti ar-ari, ket dagiti piprincipe agikeddengda ti kinalinteg.",
			"16": "<sup>16</sup> Gapu caniac agturay dagiti piprincipe, ken dagiti natacneng, wen, amin dagiti oc-ocom ditoy daga.",
			"17": "<sup>17</sup> Ayatec dagiti agayat caniac; ket dagiti mangbiruc a sigaganetget caniac masaracandacto.",
			"18": "<sup>18</sup> Kinabacnang ken dayaw addada caniac; wen, ti napaut a kinabacnang ken kinalinteg.",
			"19": "<sup>19</sup> Ti bungac nasaysayaat ngem balitoc, wen, ngem iti nasudi a balitoc, ket ti pataudec nasaysayaat ngem pirac a napili.",
			"20": "<sup>20</sup> Magnaac iti dalan ti kinalinteg, iti tengnga dagiti dandana ti kinajusticia;",
			"21": "<sup>21</sup> Tapno dagiti agayat caniac mapagtawidco iti sanicua, ken tapno punoec dagiti paggamenganda.",
			"22": "<sup>22</sup> Ni Jehova inicutannac idi pangrugian ti dalanna, idi casacbayan dagiti ar-aramidna idi ugma.",
			"23": "<sup>23</sup> Naipatacderac nanipud kinaagnanayon, nanipud idi punganay, idi awan pay toy daga.",
			"24": "<sup>24</sup> Idi awan pay dagiti yuyeng, napaaddaacon; idi awan pay ub-ubbog nga aglaplapusanan iti danum.",
			"25": "<sup>25</sup> Idi di pay naisaad dagiti banbantay, immun-una ngem dagiti turturod napaaddaacon;",
			"26": "<sup>26</sup> Idi a dina pay la inaramid ti daga, ken dagiti taytay-ac, wenno ti punganay ti tapuc ti lubong.",
			"27": "<sup>27</sup> Idi impasdecna dagiti langlangit, addaac idiay: idi binukelna ti wangawangan ti yuyeng,",
			"28": "<sup>28</sup> Idi pinatibkerna dagiti tangtangatang iti ngato, idi napapigsa dagiti ub-ubbog ti yuyeng,",
			"29": "<sup>29</sup> Idi iniccanna ti baybay iti beddengna, tapno dagiti dandanum dida salungasingen ti panagbilinna, idi inugisanna dagiti pagsaadan toy daga;",
			"30": "<sup>30</sup> Idin addaac iti sibayna a cas mamangolo nga agobra; ket siac ti pagrag-oanna, nga inaldaw siraragsacac a canayon iti sangona,",
			"31": "<sup>31</sup> Siraragsacac iti pagnaedan a dagana; ket pagrag-oac ti pannakiadda cadagiti annac dagiti tao.",
			"32": "<sup>32</sup> Ita ngarud, annacco, dumngegcayo caniac; ta bendito dagiti mangsalimetmet cadagiti daldalanco.",
			"33": "<sup>33</sup> Denggenyo ti pannursuro, ket sumiribcayo, ken dicayo coma agkedked kencuana.",
			"34": "<sup>34</sup> Bendito ti tao a dumngeg caniac, nga agpuyat nga inaldaw cadagiti ruanganco, nga agdadaan iti asideg dagiti rikep dagiti ridawco.",
			"35": "<sup>35</sup> Ta siasinoman a macasarac caniac masaracanna ti biag, ken magun-odnanto ti parabur ni Jehova.",
			"36": "<sup>36</sup> Ngem ti agbasol a maibusor caniac padacsenna ti cararuana met laeng: amin dagiti gumurgura caniac ayatenda ni patay."
		},
		"9": {
			"1": "<sup>1</sup> Ti sirib binangonnan ti balayna; tinubayna dagiti pito nga adigina:",
			"2": "<sup>2</sup> Pinartina dagiti animalna; nangtempla iti aracna, ket pinunianna met ti lamisaanna:",
			"3": "<sup>3</sup> Imbaonna dagiti ubbingna a babbai; ipucpuccawna iti tapaw dagiti catayagan a disso ti ili:",
			"4": "<sup>4</sup> Siasinoman a nanengneng, agturong coma ditoy: no maipaay iti awanan pannacaawat, isu ibagana kencuana,",
			"5": "<sup>5</sup> Umayca, manganca itoy tinapayco, ket uminumca iti arac a tinemplac.",
			"6": "<sup>6</sup> Agsardaycayon, dacayo a nanengneng, ket agbiagcayo; ket magnacayo ala iti dalan ti pannacaawat.",
			"7": "<sup>7</sup> Ti mamagbaga iti managababi magun-oddana ti pannacauyaw; ti mangtubngar iti nadangkes a tao macagun-od ti piltac.",
			"8": "<sup>8</sup> Dica tubngaren ti managababi, di la ket ta caguranaca: tubngarem ti masirib a tao, ket ayatennacanto.",
			"9": "<sup>9</sup> Iccam iti pannursuro ti masirib a tao, ket masmasiribto pay: isurom ti sililinteg a tao, ket dumegdegto iti pannacasursuro.",
			"10": "<sup>10</sup> Ti panagbuteng ken ni Jehova isu ti punganay ti sirib; ket ti pannacaammo iti Santo isu ti pannacaawat.",
			"11": "<sup>11</sup> Ta maipuon caniac dagiti aldawmo mapaadudanto, ken dagiti tawen ti panagbiagmo manayondanto.",
			"12": "<sup>12</sup> No masiribca, masiribca a maipaay kenca met laeng; ket no mangab-abica, sicsica met laeng ti mangibtorto.",
			"13": "<sup>13</sup> Ti maag a babai naariangga; nanengneng, ket awan ammona.",
			"14": "<sup>14</sup> Ken agtutugaw iti ruangan ti balayna, iti tugaw cadagiti natayag a disso ti ili,",
			"15": "<sup>15</sup> Tapno agayab cadagiti aglabas, a magna a sililinteg cadagiti dalanda:",
			"16": "<sup>16</sup> Siasinoman a nanengneng, agturong coma ditoy; ket no maipaay iti awanan pannacaawat, isu ibagana kencuana,",
			"17": "<sup>17</sup> Dagiti tinacaw a danum nasam-itda, ket ti tinapay a kinnan nga incurcurimed naimas.",
			"18": "<sup>18</sup> Ngem isu dina ammo a dagiti natay addada sadiay; a dagiti sangailina addada cadagiti yuyeng ni Tanem."
		},
		"10": {
			"1": "<sup>1</sup> Dagiti proverbios ni Salomon. Ti masirib nga anac paragsakenna ni amana; ngem ti maag nga anac isu ti babantot ni inana.",
			"2": "<sup>2</sup> Dagiti gamgameng ti kinadakes awan mamaayda; ngem ti kinalinteg mangispal manipud ken patay.",
			"3": "<sup>3</sup> Ni Jehova dinanto ituloc a ti cararua ti nalinteg mabisinan; ngem iwalinnanto ti calicagum ti nadangkes.",
			"4": "<sup>4</sup> Pumanglaw ti agtrabajo a naliway ti imana; ngem ti ima ti nasalucag mamabacnang.",
			"5": "<sup>5</sup> Ti agurnong no calgaw masirib nga inanac; ngem ti maturog no panagani inanac a mangibabain.",
			"6": "<sup>6</sup> Dagiti bendicion agsaadda iti olo ti nalinteg, ngem ti kinauyong apputenna ti ngiwat ti nadangkes.",
			"7": "<sup>7</sup> Ti pacalaglagipan ti nalinteg nagasat; ngem ti nagan ti nadangkes aglungsotto.",
			"8": "<sup>8</sup> Ti masirib iti pusona awatennanto dagiti bilbilin; ngem ti natanattat a maag mapasagto.",
			"9": "<sup>9</sup> Ti magna a sililinteg magna a sitatalged; ngem ti mamadakes cadagiti daldalanna maammoanto.",
			"10": "<sup>10</sup> Ti agkidkidday cadagiti matana mamataud iti ladingit; ngem ti natanattat a maag mapasagto.",
			"11": "<sup>11</sup> Ti ngiwat ti nalinteg ubbog ti biag; ngem ti kinauyong abbonganna ti ngiwat ti nadangkes.",
			"12": "<sup>12</sup> Ti gura riingenna ti ringgor; ngem ti ayat abbonganna amin a salsalungasing.",
			"13": "<sup>13</sup> Cadagiti bibig ti addaan kinasaririt masaracan ti kinasirib; ngem ti pang-or maipaay iti bucot ti awanan pannacaawat.",
			"14": "<sup>14</sup> Dagiti masirib a tattao agurnongda iti pannacaammo; ngem ti ngiwat ti maag isu ti agdama a pacadadaelan.",
			"15": "<sup>15</sup> Ti sanicua ti nabacnang a tao isu ti natibker nga ilina: ti pacadadaelan ti napanglaw isu ti kinapanglawna.",
			"16": "<sup>16</sup> Ti kinamanagtrabajo ti nalinteg agduyos iti biag; ti kinarang-ay ti nadangkes agduyos iti basol.",
			"17": "<sup>17</sup> Daydiay adda iti dalan ti biag icascasona ti pammagbaga; ngem ti mangbaybay-an iti pannacatubngar agbiddut.",
			"18": "<sup>18</sup> Ti mangilimed iti gura naulbod dagiti bibigna; ti agsao iti pammadpadakes maag.",
			"19": "<sup>19</sup> Cadagiti adu a sasao saan nga agcurang ti pannacasalungasing; ngem ti manengngel cadagiti bibigna agaramid a sisisirib.",
			"20": "<sup>20</sup> Ti dila ti nalinteg cas pirac a napili: ti puso ti nadangkes bassit ti pategna.",
			"21": "<sup>21</sup> Dagiti bibbibig dagiti nalinteg adu dagiti mataraonanda; ngem dagiti maag matmatayda iti caawan ti pannacaawatda.",
			"22": "<sup>22</sup> Ti bendicion ni Jehova ti mangpabacnang; ket saanna nga anayan iti ladingit.",
			"23": "<sup>23</sup> Iti maag cas la panangayayamna ti panangaramidna iti kinadakes; ket casta met ti sirib iti tao a mannacaawat.",
			"24": "<sup>24</sup> Ti buteng ti nadangkes, dumtengto kencuana; ket ti tarigagay ti nalinteg maitedto.",
			"25": "<sup>25</sup> No macalabas ti alipugpog, ti nadangkes awanen; ngem ti nalinteg isu ti agnanayon a pacaibatayan.",
			"26": "<sup>26</sup> Cas suca cadagiti ngipen, ken cas asuc cadagiti mata, casta ti nasadut cadagiti mangibaon kencuana.",
			"27": "<sup>27</sup> Ti panagbuteng ken ni Jehova nayunanna dagiti al-aldaw; ngem dagiti tawtawen ti nadangkes mapaababadanto.",
			"28": "<sup>28</sup> Ti inanama ti nalinteg kinaragsacto; ngem ti namnama ti nadangkes mapucawto.",
			"29": "<sup>29</sup> Ti dalan ni Jehova maysa a sarikedked cadagiti nalinteg; ngem isu ti pacadadaelan cadagiti agaramid iti kinadakes.",
			"30": "<sup>30</sup> Ti nalinteg dinto maisina; ngem ti nadangkes dinto agtalinaed ditoy daga.",
			"31": "<sup>31</sup> Ti ngiwat ti nalinteg agyesngaw iti sirib; ngem ti naulpit a dila mapulsotto,",
			"32": "<sup>32</sup> Dagiti bibig ti nalinteg ammoda ti macaay-ayo; ngem ti ngiwat ti nadangkes agsao iti kinaulpit."
		},
		"11": {
			"1": "<sup>1</sup> Ti naulbod a cacatian maysa a cagura ni Jehova; ngem ti apag-isu a timbeng macaay-ayo kencuana.",
			"2": "<sup>2</sup> No umay ni tangsit, umay metten ni bain; ngem cadagiti napacumbaba adda ni sirib.",
			"3": "<sup>3</sup> Ti kinamatalec dagiti nalinteg mangidalanto cadacuada; ngem ti kinaulpit dagiti nagulib mangdadaelto cadacuada.",
			"4": "<sup>4</sup> Ti kinabacnang awanto mamaayna intono al-aldaw ti pungtot; ngem ti kinalinteg mangispal manipud ken patay.",
			"5": "<sup>5</sup> Ti kinalinteg ti napnoan-imbag paglintegenna ti dalanna; ngem ti nadangkes pacatuangannanto ti kinadangkesna met laeng.",
			"6": "<sup>6</sup> Ti kinalinteg dagiti nalinteg mangispalto cadacuada; ngem dagiti nagulib matiliwdanto iti kinadangkesda met laeng.",
			"7": "<sup>7</sup> Intono matay ti nadangkes a tao, ti namnamana mapucawto; ket ti inanama ti kinadangkesda mapucaw:",
			"8": "<sup>8</sup> Ti nalinteg maispalto iti ducot, ket ti nadangkes maisandi kencuana.",
			"9": "<sup>9</sup> Ti nadangkes a tao dadaelenna gapu iti ngiwatna ti caarrubana; ngem gapu iti pannacaammo maispalto ti nalinteg.",
			"10": "<sup>10</sup> No adda pagimbagan dagiti nalinteg, ti ili agragragsac; ket no ti nadangkes mapucaw, adda panagdir-i.",
			"11": "<sup>11</sup> Gapu iti panangbendicion dagiti nalinteg maitanoc ti ili; ngem maitublac gapu iti ngiwat dagiti nadangkes.",
			"12": "<sup>12</sup> Ti mangumsi iti caarrubana awan ti siribna; ngem ti tao a mannacaawat agul-ulimec.",
			"13": "<sup>13</sup> Ti agalallatiw nga agidanondanon iti saosao, agipalgac iti palpalimed; ngem ti sitatalinaed ti espirituna ilimedna ti panggep.",
			"14": "<sup>14</sup> Adinoman ti awanan ti nainsiriban a panangidalan, ti umili matuang; ngem iti caadu dagiti mamalbalacad adda pannacaisalacan.",
			"15": "<sup>15</sup> Ti mangpatalged iti gangannaet, pagsicsicorannanto; ngem ti manggura iti kinamanagpatalged, sitatalged.",
			"16": "<sup>16</sup> Ti nanakem a babai magun-odna ti dayaw; ket dagiti nainget a lallaki magun-odda dagiti kinabacnang.",
			"17": "<sup>17</sup> Ti manangngaasi a tao agaramid iti pagimbagan ti cararuana met laeng, ngem ti nadangcoc parigatenna ti lasangna met laeng.",
			"18": "<sup>18</sup> Ti nadangkes magungunana dagiti macaallilaw a supapac; ngem ti agmula iti kinalinteg aglac-am ti napaypayso a gunguna.",
			"19": "<sup>19</sup> Ti sitatalinaed iti kinalinteg macagtengto iti biag; ket ti mangsurot iti dakes aramidenna iti pacatayanna met laeng.",
			"20": "<sup>20</sup> Dagiti naulpit iti puso isuda dagiti macarimon ken ni Jehova; ngem dagiti napnoan-imbag iti dalanda isuda dagiti macaay-ayo kencuana.",
			"21": "<sup>21</sup> Uray ti ima ken ima agpinnetpetda, ti dakes a tao saanto a di-madusaan; ngem ti putot dagiti nalinteg maispalto.",
			"22": "<sup>22</sup> Cas aritos a balitoc iti subsub ti babuy, casta ti naimnas a babai nga awanan kinaannad.",
			"23": "<sup>23</sup> Ti tarigagay dagiti nalinteg isu laeng ti naimbag; ngem ti panangnamnama dagiti nadangkes kinapungtot.",
			"24": "<sup>24</sup> Adda agiburay ket sumanicua pay ket di; ket adda agmetmet a nasursuroc pay ngem carbenganna, ket agbanag laeng ken kinapanglaw.",
			"25": "<sup>25</sup> Ti managparabur a cararua mapalucmegto; ket ti agsibug, isu met laeng masibuganto.",
			"26": "<sup>26</sup> Ti mangyimot iti bagas, isu ilunlunodto ti umili; ngem ti bendicion agdissonto iti olo ti mangilaco.",
			"27": "<sup>27</sup> Ti siaanep a mangbiruc iti imbag, birukenna ti parabur, ngem ti mangsarsarac iti dakes isu ti umayto kencuana.",
			"28": "<sup>28</sup> Ti agtalec cadagiti sanicuana matnagto; ngem ti sililinteg lumapsatto a cas nalangto a bulong.",
			"29": "<sup>29</sup> Ti mangriribuc iti balayna met laeng agtawidto iti angin; ket ti maag adipento ti masirib ti pusona.",
			"30": "<sup>30</sup> Ti bunga ti nalinteg isu maysa a cayo ti biag; ket ti masirib macaguyuguy cadagiti carcararua.",
			"31": "<sup>31</sup> Adtoy, ti nalinteg masupapacanto ditoy daga: ket adaddapay ti nadangkes ken managbasol!"
		},
		"12": {
			"1": "<sup>1</sup> Siasinoman nga agayat iti pannacaisuro ayatenna ti pannacaammo; ngem ti manggura iti panagtubngar nadueg.",
			"2": "<sup>2</sup> Ti naimbag a tao maragpatnanto ti parabur ni Jehova; ngem iti tao a nadangkes dagiti panggepna isu dusaennanto.",
			"3": "<sup>3</sup> Ti tao saanto a mapasingkedan a gapu iti kinadangkes; ngem ti ramut ti nalinteg dinto magaraw.",
			"4": "<sup>4</sup> Ti natalunggadingan a babai isu ti balangat ni asawana; ngem ti agaramid iti nacababain isu ti cas panagtumoy cadagiti tultulangna.",
			"5": "<sup>5</sup> Dagiti pampanunot dagiti nalinteg apagisuda; ngem dagiti balbalacad dagiti nadangkes isuda dagiti panangallilaw.",
			"6": "<sup>6</sup> Dagiti sasao dagiti nadangkes panagsibloc iti dara; ngem ti ngiwat dagiti nalinteg mangispalto cadacuada.",
			"7": "<sup>7</sup> Dagiti nadangkes maitublacda, ket maawandan; ngem ti balay dagiti nalinteg sititibkerto.",
			"8": "<sup>8</sup> Ti maysa a tao madayawto cas mayalubog iti kinasiribna; ngem ti nadangkesan iti puso mauyuyawto.",
			"9": "<sup>9</sup> Nasaysayaat ti bassit ti pannacaipatpategna, ket adda adipenna, ngem ti mangidaydayaw iti bagina met laeng, sa ket awan canenna.",
			"10": "<sup>10</sup> Ti nalinteg a tao ipatpategna ti biag ti animalna; ngem dagiti nadungngo a caasi ti nadangkes nadawelda.",
			"11": "<sup>11</sup> Ti mangtalon iti dagana addaanto iti naruay a canen; ngem ti sumursurot cadagiti barengbareng awanan ti pannacaawat.",
			"12": "<sup>12</sup> Ti nadangkes tarigagayanna ti bateng dagiti dakes a tattao; ngem ti ramut ti nalinteg agbunganto.",
			"13": "<sup>13</sup> Cadagiti panaglabsing dagiti bibig isu ti pangsilo iti dakes a tao; ngem ti nalinteg macalapsutto iti pagducotan.",
			"14": "<sup>14</sup> Ti tao mapnecto iti imbag gapu iti bunga ti ngiwatna; ket dagiti gapuanan dagiti im-ima ti tao maipaaydanto kencuana.",
			"15": "<sup>15</sup> Ti dalan ti maag nalinteg cadagiti matana met laeng; ngem ti masirib ipangagna ti balacad.",
			"16": "<sup>16</sup> Ti alipunget ti maag maammoan a dagus; ngem ti manakem a tao lingdanna ti pacabainan.",
			"17": "<sup>17</sup> Ti mangyesngaw iti pudno iparangarangna ti kinalinteg; ngem ti naulbod a sacsi mangallilaw.",
			"18": "<sup>18</sup> Adda agsao a sidadarasudos a cas cadagiti panagduyoc ti campilan; ngem ti dila ti masirib isu ti salun-at.",
			"19": "<sup>19</sup> Ti bibig ti pudno mapagtalinaedto iti agnanayon; ngem ti natiri a dila apagdaricmat laeng.",
			"20": "<sup>20</sup> Ti panangallilaw adda iti puso dagiti agpakinakem iti dakes; ngem cadagiti mangibalbalacad iti cappia adda ragsac.",
			"21": "<sup>21</sup> Awanto ti pagdacsan a mapasamac iti nalinteg; ngem ti nadangkes mapnonto iti dakes.",
			"22": "<sup>22</sup> Dagiti natiri a dila macarimonda ken ni Jehova; ngem dagiti agar-aramid a matalec macaay-ayoda kencuana.",
			"23": "<sup>23</sup> Ti nanacman a tao ilalaenna ti ammona; ngem ti puso dagiti maag agibunannag iti kinamaag.",
			"24": "<sup>24</sup> Ti ima dagiti nagaget agiggemto iti panagturay; ngem ti nasadut maipaconto iti aramid a nadagsen.",
			"25": "<sup>25</sup> Ti bantot ti puso ti maysa a tao mamagdumog kencuana; ngem ti naimbag a sao paragsakenna.",
			"26": "<sup>26</sup> Ti nalinteg isu ti mangidalan iti caarrubana; ngem ti dalan dagiti nadangkes mangpabiddut cadacuada.",
			"27": "<sup>27</sup> Ti nasadut a tao dina tonoen ti naalana iti panaganup; ngem ti napateg a gupit dagiti tattao maipaay iti nagaget.",
			"28": "<sup>28</sup> Iti dalan ti kinalinteg adda ti biag; ket iti desdesna awan ni patay."
		},
		"13": {
			"1": "<sup>1</sup> Ti masirib nga anac ipangagna ti pannursuro ni amana; ngem ti managuyaw dina icascaso ti panangtubngar.",
			"2": "<sup>2</sup> Ti maysa a tao manganto iti naimbag maigapu iti bunga ti ngiwatna; ngem ti cararua ti mangliliput manganto iti kinauyong.",
			"3": "<sup>3</sup> Ti mangaluad iti ngiwatna salimetmetanna ti biagna; ngem ti manginganga a napalalo cadagiti bibigna addanto kencuana ti pannacadadael.",
			"4": "<sup>4</sup> Ti cararua ti nasadut agtarigagay, ket awan mapaaddana; ngem ti cararua ti nagaget mapalucmegto.",
			"5": "<sup>5</sup> Ti nalinteg a tao guraenna ti panagtiri; ngem ti nadangkes a tao nacarimrimon, ket maibabain.",
			"6": "<sup>6</sup> Ti kinalinteg saluadanna ti nalinteg iti dalan; ngem ti kinadangkes ipadsona ti managbasol.",
			"7": "<sup>7</sup> Adda la ket tay paginbabacnangenna ti bagina, ket awan met ti adda kencuana; adda la ket tay aginpapanglaw, ngem dackel ti kinabacnangna.",
			"8": "<sup>8</sup> Ti subbot ti biag ti tao isu ti kinabacnangna; ngem ti napanglaw dina ipangag ti panangamames.",
			"9": "<sup>9</sup> Ti silaw ti nalinteg agragragsac; ngem ti pagsilawan ti nadangkes maiddepto.",
			"10": "<sup>10</sup> Gapu iti kinatangsit umay la ti riri; ngem cadagiti managsacbay adda ni sirib.",
			"11": "<sup>11</sup> Ti sanicua a magun-odan iti kinaubbaw macraayto. Ngem ti agurnong gapu iti pagbannoganna manayonanto.",
			"12": "<sup>12</sup> Ti inanama a maitantantan pagsakitenna ti puso; ngem no umapay ni calicagum, isu ti maysa a cayo ti biag.",
			"13": "<sup>13</sup> Ti mangumsi iti sao iyegna kencuana met laeng ti pannacadadael; ngem ti agbuteng iti bilin magungunaanto.",
			"14": "<sup>14</sup> Ti linteg ti masirib ubbog ti biag, tapno ti tao liclicanna dagiti pangsilo ni patay.",
			"15": "<sup>15</sup> Ti nasayaat a panagawawat mangted iti parabur; ngem ti dalan ti managsalungasing narigat.",
			"16": "<sup>16</sup> Amin a manakem a tao agaramid a siaammo; ngem ti maag iparammagna ti kinamaagna.",
			"17": "<sup>17</sup> Ti nadangkes a maibaon matnag iti dakes; ngem ti matalec nga embajador isu ti salun-at.",
			"18": "<sup>18</sup> Kinapanglaw ken bain addanto iti daydiay agmadi iti pannacaisuro; ngem ti mangicancano iti panangtubngar mapadayawanto.",
			"19": "<sup>19</sup> Ti calicagum a matungpal nasam-it iti cararua; ngem isu ti maysa a carimon dagiti maag ti ipapanawda iti dakes.",
			"20": "<sup>20</sup> Makicuyogca cadagiti masirib a tattao, ket masiribcanto; ngem ti makicuyog cadagiti maag pagsicorannanto.",
			"21": "<sup>21</sup> Ti dakes camatcamatenna dagiti managbasol; ngem ti nalinteg masupapacanto iti imbag.",
			"22": "<sup>22</sup> Ti naimbag a tao macaibati iti tawid cadagiti annac dagiti annacna; ket ti sanicua ti managbasol mapenpen a maipaay iti nalinteg.",
			"23": "<sup>23</sup> Adu ti taraon idiay talonen ti napanglaw; ngem adda madadael gapu iti saan a kinalinteg.",
			"24": "<sup>24</sup> Ti mangiliclic iti pagbaot cagurana ni anacna; ngem ti agayat kencuana saplitenna a siannad.",
			"25": "<sup>25</sup> Ti nalinteg mangan iti pacapnecan ti cararuana; ngem ti tian ti nadangkes macuranganto."
		},
		"14": {
			"1": "<sup>1</sup> Amin a masirib a babai bangonenna ti balayna; ngem ti maag purienna cadagiti im-imana met laeng.",
			"2": "<sup>2</sup> Ti magna iti kinalintegna agbuteng ken ni Jehova; ngem ti nadangkesan cadagiti dalanna isu umsienna.",
			"3": "<sup>3</sup> Iti ngiwat ti maag adda pagbaot a maipaay iti tangsitna; ngem dagiti bibig dagiti masirib mangsalacnib cadacuada.",
			"4": "<sup>4</sup> Iti yan nga awan dagiti vacvaca, nadalus ti colloob; ngem adu ti pagrang-ayan gapu iti bileg ti vaca.",
			"5": "<sup>5</sup> Ti matalec a sacsi dinto agtiri; ngem ti naulbod a sacsi agyesngaw cadagiti tiri.",
			"6": "<sup>6</sup> Ti managuyaw birukenna ti sirib, ket awan; ngem ti pannacaammo nalaca iti addaan pannacaawat.",
			"7": "<sup>7</sup> Inca iti sangoanan ti maag a tao, ket dicanto maimatangan kencuana dagiti bibig ti pannacaammo.",
			"8": "<sup>8</sup> Ti sirib ti manakem isu ti pannacaawatna iti dalanna; ngem ti kinamaag dagiti maag pannacallilaw.",
			"9": "<sup>9</sup> Ti daton iti salungasing ababienna dagiti maag; ngem cadagiti nalinteg adda naimbag a nakem.",
			"10": "<sup>10</sup> Ti puso ammona ti bucudna a kinapait; ket ti gangannaet saan a maibiang iti ragsacna.",
			"11": "<sup>11</sup> Ti balay ti nadangkes mapadsonto; ngem ti calapaw ti nalinteg rumangpayanto.",
			"12": "<sup>12</sup> Adda dalan a cas la nalinteg iti maysa a tao; ngem ti tungpalna daldalan ni patay.",
			"13": "<sup>13</sup> Uray iti panagcatawa ti puso agladingit; ket ti tungpal ti ragsac isu ti babantot.",
			"14": "<sup>14</sup> Ti sumanud iti pusona mabsugto cadagiti bucudna a dalan; ket ti naimbag a tao mapnecto gapu kencuana met laeng.",
			"15": "<sup>15</sup> Ti nanengneng patienna amin a sao; ngem ti manakem a tao matmatanna a nalaing ti papananna.",
			"16": "<sup>16</sup> Ti masirib a tao agbuteng, ket umadayu iti dakes; ngem ti maag iparangna ti kinatangsitna, ket agtaltalec.",
			"17": "<sup>17</sup> Ti nadaras nga agpungtot minamaagto ti panagaramidna; ket ti tao a nadangkes ti sigsigpenna magurgura.",
			"18": "<sup>18</sup> Ti nanengneng agtawid iti kinamaag; ngem dagiti manakem mabalangatanda iti pannacaammo.",
			"19": "<sup>19</sup> Dagiti managdacdakes agrucnoyda iti saclang dagiti naimbag; ken dagiti nadangkes, cadagiti ruangan dagiti nalinteg.",
			"20": "<sup>20</sup> Ti napanglaw manggurgura uray iti caarrubana met laeng; ngem ti nabacnang adu dagiti gagayyemna.",
			"21": "<sup>21</sup> Ti mangumsi iti caarrubana macabasol; ngem ti adda caasina cadagiti napanglaw, isu ti naragsac.",
			"22": "<sup>22</sup> Saanda aya a bumiddut dagiti agpakinakem iti dakes? Ngem ti caasi ken pudno maipaaydanto iti agpakinakem iti naimbag.",
			"23": "<sup>23</sup> Iti amin a trabajo adda gungunaen; ngem ti sarsarita dagiti bibbibig agturong laeng iti kinapanglaw.",
			"24": "<sup>24</sup> Ti balangat dagiti masirib isu dagiti kinabacnangda; ngem ti kinamaag dagiti maag kinamaag laeng.",
			"25": "<sup>25</sup> Ti napudno a sacsi mangispal cadagiti cararua; ngem ti agyesngaw cadagiti ul-ulbod mangallilaw.",
			"26": "<sup>26</sup> Iti panagbuteng ken ni Jehova adda napigsa a panagtalec; ket dagiti annacna addaandanto ayan a pagcamanganda.",
			"27": "<sup>27</sup> Ti panagbuteng ken ni Jehova isu ti ubbog ti biag; tapno ti tao liclicanna dagiti pangsilo ni patay.",
			"28": "<sup>28</sup> Ti dayag ti ari adda iti kinaadu ti umili; ngem ti pacarbaan ti principe adda iti kinakirang ti umili.",
			"29": "<sup>29</sup> Ti nabannayat a macapungtot dackel ti pannacaawatna; ngem ti nadarasudos ti espirituna itantan-ocna ti kinamaag.",
			"30": "<sup>30</sup> Ti natalna a puso isu ti biag ti lasag; ngem ti agum isu ti panagtumoy dagiti tultulang.",
			"31": "<sup>31</sup> Ti mamarigat iti napanglaw laisenna ti Namarsua kencuana; ngem ti addaan caasi iti macurangan padayawanna.",
			"32": "<sup>32</sup> Ti nadangkes maipadso iti dakes a panagcucuana; ngem ti nalinteg adda pagcamanganna iti ipapatayna.",
			"33": "<sup>33</sup> Ni sirib agintec iti puso ti addaan pannacaawat; ngem ti adda iti caungan dagiti maag maibunannag.",
			"34": "<sup>34</sup> Ti kinalinteg itan-ocna ti nacion; ngem ti basol pacaumsian ti aniaman nga umili.",
			"35": "<sup>35</sup> Ti parabur ti ari agturong iti adipen a nainsiriban ti aramidna; ngem ti pungtotna agturongto iti mangibabain."
		},
		"15": {
			"1": "<sup>1</sup> Ti naalumamay a sungbat pagbawingenna ti pungtot; ngem ti macapaladingit a sao pataudenna ti unget.",
			"2": "<sup>2</sup> Ti dila ti masirib iyesngawna ti pannacaammo nga apag-isu; ngem ti ngiwat dagiti maag agibuyat iti kinamaag.",
			"3": "<sup>3</sup> Dagiti mata ni Jehova addada iti amin a yan, a sisisiput cadagiti dakes ken naimbag.",
			"4": "<sup>4</sup> Ti nanacman a dila isu maysa a cayo ti biag; ngem ti kinaulpit kencuana pacadudugan ti espiritu.",
			"5": "<sup>5</sup> Ti maag umsienna ti panangisuro ni amana; ngem ti mangipateg iti panagtubngar gun-odenna ti kinamanakem.",
			"6": "<sup>6</sup> Iti balay ti nalinteg adda adu a gameng; ngem cadagiti maunnudan ti nadangkes isu ni ducot.",
			"7": "<sup>7</sup> Dagiti bibig ti masirib agiwaras ti pannacaammo; ngem ti puso ti maag saanna nga aramiden ti casta.",
			"8": "<sup>8</sup> Ti daton ti nadangkes macarimon ken ni Jehova; ngem ti cararag ti nalinteg isu ti macaay-ayo kencuana.",
			"9": "<sup>9</sup> Ti dalan ti nadangkes macarimon ken ni Jehova; ngem ayatenna ti sumurot iti kinalinteg.",
			"10": "<sup>10</sup> Adda dusa a nasaem iti mangbaybay-an iti dalan; ket  ti gumura iti panangtubngar matayto.",
			"11": "<sup>11</sup> Da Tanem ken Dadael addada iti saclang ni Jehova: ket adadda pay dagiti puspuso dagiti annac dagiti tattao!",
			"12": "<sup>12</sup> Ti managumsi dina pagayatan ti matubngar; dinto mapan cadagiti masirib.",
			"13": "<sup>13</sup> Ti naragsac a puso paisemenna ti rupa; ngem gapu ti ladingit ti puso madudog ti espiritu.",
			"14": "<sup>14</sup> Ti puso ti addaan pannacaawat birukenna ti pannacaammo; ngem ti ngiwat dagiti maag agtaraon iti kinamaag.",
			"15": "<sup>15</sup> Amin nga al-aldaw ti naparigat dakesda; ngem ti siraragsac ti pusona cancanayon a daya kencuana.",
			"16": "<sup>16</sup> Nasaysayaat ti bassit, a cacuyogna ti panagbuteng ken ni Jehova, ngem ti dackel a gameng ket ducot ti cacanunongna.",
			"17": "<sup>17</sup> Nasaysayaat ti pangaldaw a natnateng, nga addaan ayat, ngem ti napalucmeg a vaca ket gura ti cacuyogna.",
			"18": "<sup>18</sup> Ti managpungtot a tao pataudenna ti riri; ngem ti nabannayat nga agpungtot epepenna ti ringgor.",
			"19": "<sup>19</sup> Ti dalan ti nasadut cas la alad a siit; ngem ti dalan ti nalinteg calsada a dackel.",
			"20": "<sup>20</sup> Ti masirib nga anac paragsakenna ni amana; ngem ti maag a tao laisenna ni inana.",
			"21": "<sup>21</sup> Ti kinamaag pacaragsacan ti awanan sirib; ngem ti tao a mannacaawat lintegenna ti pannagnana.",
			"22": "<sup>22</sup> No awan ti balacad, dagiti gandat mawasda; ngem iti caadu dagiti mamalacad mapatibkerda.",
			"23": "<sup>23</sup> Ti tao adda ragsacna iti sungbat ti ngiwatna; ket ti maysa a sao iti maitutop a tiempo, anian a nagsayaat!",
			"24": "<sup>24</sup> Iti masirib ti dalan ti biag agpangato, tapno mapanawanna ti tanem iti baba.",
			"25": "<sup>25</sup> Ni Jehova parutennanto ti balay ti natangsit; ngem ipasdecnanto ti paginggaan ti babai a balo.",
			"26": "<sup>26</sup> Dagiti dakes a pacpakinakem macarimonda ken ni Jehova; ngem dagiti nacaay-ayo a sasao nadalusda.",
			"27": "<sup>27</sup> Ti narawet iti gungunaen paringgorenna ti balayna met laeng; ngem ti manggura cadagiti pannucsuc, agbiagto.",
			"28": "<sup>28</sup> Ti puso ti nalinteg panunutenna ti isusungbatna; ngem ti ngiwat ti nadangkes agibuyat cadagiti dakes a banbanag.",
			"29": "<sup>29</sup> Ni Jehova adayu cadagiti nadangkes; ngem ipangagna ti cararag dagiti nalinteg.",
			"30": "<sup>30</sup> Ti silnag dagiti mata paragsakenna ti puso; ken dagiti naimbag a damdamag palucmegenda dagiti tultulang.",
			"31": "<sup>31</sup> Ti lapayag a mangipangag iti panangtubngar ti biag makipagtaengto cadagiti masirib.",
			"32": "<sup>32</sup> Ti mangpaid iti pannacaisuro laisenna ti cararuana met laeng; ngem ti mangipangag iti panangtubngar gun-odenna iti pannacaawat.",
			"33": "<sup>33</sup> Ti panagbuteng ken ni Jehova sursuro ti sirib; ket umun-una ti kinapacumbaba ngem ti dayaw."
		},
		"16": {
			"1": "<sup>1</sup> Dagiti pakinakem ti puso biang ti tao; ngem ti sungbat ti dila biang ni Jehova.",
			"2": "<sup>2</sup> Amin dagiti daldalan ti maysa a tao nadalusda cadagiti matana met laeng; ngem ni Jehova gantingenna dagiti espiritu.",
			"3": "<sup>3</sup> Icumitmo dagiti ar-aramidmo ken ni Jehova, ket dagiti pangpanggepmo mapasingkedandanto.",
			"4": "<sup>4</sup> Ni Jehova inaramidna tunggal banag iti pacaipaayanna; wen, uray dagiti nadangkes a maipaay iti aldaw ti ranggas.",
			"5": "<sup>5</sup> Isu-amin a natangsit ti pusona macarimon ken ni Jehova; uray ti ima ken ima agpinnetpetda, isu saanto a di madusa.",
			"6": "<sup>6</sup> Gapu iti caasi ken kinapudno mapacawan ti kinadakes; ket gapu iti panagbuteng ken ni Jehova dagiti tattao panawanda ti dakes.",
			"7": "<sup>7</sup> No dagiti daldalan ti maysa a tao macaayayoda ken ni Jehova, pakicappiaenna kencuana uray dagiti cabcabusorna.",
			"8": "<sup>8</sup> Nasaysayaat ti bassit, a cacuyogna ti kinalinteg, ngem ti adu a masapulan a cacanunong ti kinakillo.",
			"9": "<sup>9</sup> Ti puso ti tao dardarepdepenna ti dalanna, ngem ni Jehova ti mangiturong cadagiti addangna.",
			"10": "<sup>10</sup> Ti nadiosan a panangikeddeng adda cadagiti bibig ti ari; ti ngiwatna saanto nga agsalungasing iti panangipato.",
			"11": "<sup>11</sup> Ti apag-isu a titimbengan ken cacatian cucua ida ni Jehova; amin dagiti panimbeng iti supot aramidna.",
			"12": "<sup>12</sup> Maysa a macarimon cadagiti ar-ari ti panagaramid iti kinadangkes; ta ti trono maipasdec babaen ti kinalinteg.",
			"13": "<sup>13</sup> Dagiti sililinteg a bibig isuda dagiti macaayayo cadagiti ar-ari; ket ayayatenda ti agsao iti nalinteg.",
			"14": "<sup>14</sup> Ti rungsot ti maysa nga ari cas cadagiti babaonen ni patay; ngem ti masirib a tao pagtalnaennanto.",
			"15": "<sup>15</sup> Iti lawag ti langa ti ari adda biag; ket ti paraburna cas ulep ti maududi a tudo.",
			"16": "<sup>16</sup> Anian a kinasaysayaat ti pananggun-od iti kinasirib ngem iti balitoc! Wen, ti pananggun-od iti pannacaawat adadda a pilien ngem iti pirac.",
			"17": "<sup>17</sup> Ti calsada ti nalinteg isu ti ipapanawna iti dakes; ti mangsalimetmet iti dalanna salacnibanna ti cararuana.",
			"18": "<sup>18</sup> Ti kinatangsit umununa ngem ti pannacadadael, ket ti napalangguad nga espiritu casacbayan ti pannacatnag.",
			"19": "<sup>19</sup> Nasaysayaat ti kinapacumbaba ti espiritu cadagiti napanglaw, ngem ti pannakibingay iti sinamsam cadagiti natangsit.",
			"20": "<sup>20</sup> Ti mangicancano iti sao masaracannanto ti imbag; ket siasinoman nga agcammatalec ken ni Jehova, isu ti naragsac.",
			"21": "<sup>21</sup> Ti masirib ti pusona managanto iti manakem; ket ti kinasam-it dagiti bibig degdeganna ti pannacasursuro.",
			"22": "<sup>22</sup> Ti pannacaawat isu ti ubbog ti biag iti tao nga agicut; ngem ti pacatubngaran dagiti maag isu ti kinamaagda.",
			"23": "<sup>23</sup> Ti puso ti masirib isurona ti ngiwatna; ket nayonanna ti pannacasursuro dagiti bibigna.",
			"24": "<sup>24</sup> Dagiti nacaay-ayo a sasao arigda la rara, nasam-itda iti cararua, ket salun-at cadagiti tultulang.",
			"25": "<sup>25</sup> Adda dalan a cas la nalinteg iti maysa a tao, ngem ti panungpalanna daldalan ni patay.",
			"26": "<sup>26</sup> Ti ganas ti agtrabajo a tao agtrabajo a gapu kencuana; ta ti ngiwatna ti mangdagdag.",
			"27": "<sup>27</sup> Ti tao nga awan cais-iscanna sigsigpenna ti ranggas; ket cadagiti bibigna adda bumarbara nga apuy.",
			"28": "<sup>28</sup> Ti naulpit a tao agiracurac iti ringgor; ti managarasaas mapaadayuna dagiti nadecket a gagayyem.",
			"29": "<sup>29</sup> Ti tao a nauyong masulisugna ti caarrubana, ken iturongna iti dalan a saan a naimbag.",
			"30": "<sup>30</sup> Daydiay agkidem tapno agpakinakem cadagiti nadangkes a banbanag; ken mangem-em cadagiti bibigna mangpaltuad iti dakes.",
			"31": "<sup>31</sup> Ti ubanan nga olo balangat ti kinadayag; no masaracanto iti dalan ti kinalinteg.",
			"32": "<sup>32</sup> Ti nabannayat nga agpungtot nasaysayaat ngem ti nabileg; ket ti macatengngel iti espirituna, nasaysayaat ngem ti mangparmec iti maysa a pagilian.",
			"33": "<sup>33</sup> Ti gasat maipisoc iti saclot; ngem ti dagup ti pannacaikeddengna biang ni Jehova."
		},
		"17": {
			"1": "<sup>1</sup> Nasaysayaat ti sangcasacmul a kilabban ket cacuycuyogna ti kinatalna, ngem ti balay a napno iti panagramrambac a buyugen ti riri.",
			"2": "<sup>2</sup> Ti adipen a nanacman ti cababalinna iturayannanto ti anac a mangibabain, ket maibingayto iti tawiden dagiti agcacabsat.",
			"3": "<sup>3</sup> Ti pagguguran agservi iti pirac, ken ti horno iti balitoc; ngem ni Jehova suutenna dagiti puspuso.",
			"4": "<sup>4</sup> Ti managdacdakes imdenganna dagiti nadangkes a bibig; ket ti naulbod ipangagna ti dila a naranggas.",
			"5": "<sup>5</sup> Siasinoman a mangrabrabac iti napanglaw, umsienna ti Namarsua kencuana; ket ti agraasac iti kinadacsangasat ti sabali saanto a di-madusa.",
			"6": "<sup>6</sup> Ti annac dagiti annac isuda dagiti balangat dagiti lallacay; ket ti dayaw dagiti annac dagiti dadackelda.",
			"7": "<sup>7</sup> Ti nadaeg a sarita saan a maipaay iti maag; adadda manen a saan a maipaay dagiti naulbod a bibig iti principe.",
			"8": "<sup>8</sup> Ti pannocsoc cas napateg a bato cadagiti matmata ti tao nga agicut; uray sadinoman a turongenna, rumang-ay.",
			"9": "<sup>9</sup> Ti mangabbong iti salungasing birukenna ti ayat; ngem ti mangdagdagullit iti maysa a panggep, mapaadayu dagiti nadecket a gagayyem.",
			"10": "<sup>10</sup> Ti panangtubngar sumrec a naununeg iti maysa nga addaan pannacaawat ngem ti sangagasut a baot iti maysa a maag.",
			"11": "<sup>11</sup> Ti dakes a tao birbirukenna laeng ti panagsukir; iti casta ti nadawel a babaonen maibaonto a bumusor kencuana.",
			"12": "<sup>12</sup> Nasaysayaat a masarac ti oso a babai a natacawan cadagiti annacna ngem iti maysa a tao a maag iti kinamaagna.",
			"13": "<sup>13</sup> Siasinoman a mangisupapac ti dakes iti imbag, ti dakes dinto pumanaw iti balayna.",
			"14": "<sup>14</sup> Ti pannacairugi ti riri cas la no ti maysa ibuangna ti danum; gapuna lisiam ti susic, iti sacbay ti riribuc.",
			"15": "<sup>15</sup> Ti mangalangon iti nadangkes, ken ti mangirurumen iti nalinteg, isuda a dua agpadpadada a macarimon ken ni Jehova.",
			"16": "<sup>16</sup> Apay adda aya iti ima ti maag pateg a panggatangna iti kinasirib, idinto nga awan kencuana ti pannacaawat?",
			"17": "<sup>17</sup> Ti gayyem agayat iti amin a tiempo; ket ti cabsat nayanac a maipaay a casalisal.",
			"18": "<sup>18</sup> Ti tao nga awanan pannacaawat iyunnatna ti imana, ket agbalin a talged iti saclang ti caarrubana.",
			"19": "<sup>19</sup> Ayatenna ti panagsalungasing ti agayat iti ringgor: ket ti mangitol-o iti ruanganna birukenna ti pannacadadael.",
			"20": "<sup>20</sup> Ti naiwawa ti pusona awan imbag a masaracna; ket ti addaan naulpit a dila matnag iti ranggas.",
			"21": "<sup>21</sup> Ti agputot iti maag pagladladingitannanto; ken ti ama ti maag awan ragsacna.",
			"22": "<sup>22</sup> Ti naragsac a puso naimbag nga agas; ngem ti siduducot nga espiritu magmaganna ti tultulang.",
			"23": "<sup>23</sup> Ti nadangkes a tao awatenna ti pannocsoc nga aggapu iti barucong, a mangkillo cadagiti daldalan ti kinajusticia.",
			"24": "<sup>24</sup> Ti kinasirib adda iti saclang ti addaan pannacaawat; ngem dagiti mata ti maag addada cadagiti pungto ti daga.",
			"25": "<sup>25</sup> Ti maag nga anac isu ti liday ken amana, ken pait iti nangipasngay kencuana.",
			"26": "<sup>26</sup> Casta met ti panangdusa iti nalinteg, saan a naimbag, uray ti panangdanar cadagiti natacneng gapu ti kinalintegda.",
			"27": "<sup>27</sup> Ti mangmedmed cadagiti saona addaan pannacaammo; ket ti nalamiis ti nakemna tao a mannacaawat.",
			"28": "<sup>28</sup> Uray pay ti maag, no agulimec, maibilang a masirib; no pagcaemenna dagiti bibigna, maibilang a manakem."
		},
		"18": {
			"1": "<sup>1</sup> Ti suminsina birukenna ti tarigagayanna met laeng, ket carungsotna ti amin a natarnaw a kinasirib.",
			"2": "<sup>2</sup> Ti maag awanan rag-o iti pannacaawat, no saan laeng a ti panangipadlaw ti pusona.",
			"3": "<sup>3</sup> No dumteng ti nadangkes, dita dumteng met ti uyaw, ket iti panangibabain cumuyog ti umsi.",
			"4": "<sup>4</sup> Dagiti sasao ti ngiwat ti tao arigda cadagiti adalem a dandanum; ti ubbog ti sirib cas agayus a baresbes.",
			"5": "<sup>5</sup> Ti pammadayaw iti kinatao ti nadangkes saan a nasayaat, uray ti panangkillo iti nalinteg iti panangocom.",
			"6": "<sup>6</sup> Dagiti bibig ti maag sumrecda iti susic, ket ti ngiwatna agayab cadagiti sapsaplit.",
			"7": "<sup>7</sup> Ti ngiwat ti maag isu ti pacadadaelanna, ket dagiti bibigna isuda ti pangsilo ti cararuana.",
			"8": "<sup>8</sup> Dagiti sasao ti managarasaas arigda la sangcasacmul a naimas, ken dumanonda cadagiti caungan a paspaset.",
			"9": "<sup>9</sup> Casta met daydiay naliway iti aramidna isu ti cabsat ti managdadael.",
			"10": "<sup>10</sup> Ti nagan ni Jehova nabileg a sarikedked; ti nalinteg agcamang kencuana, ket maisalacan.",
			"11": "<sup>11</sup> Ti sanicua ti nabacnang a tao isu ti nabileg nga ilina, ket cas natayag a bacud iti panangipagarupna.",
			"12": "<sup>12</sup> Iti casacbayan ti pannacadadael, ti puso ti tao agpalangguad; ket iti casacbayan ti kinadayaw adda ni kinapacumbaba.",
			"13": "<sup>13</sup> Ti sumungbat a di pay dumngeg nga umuna, kinamaag ken pacaibabainanna.",
			"14": "<sup>14</sup> Ti espiritu ti tao ibturennanto ti kinacapsutna; ngem iti naducot nga espiritu siasino ti macaanus?",
			"15": "<sup>15</sup> Ti puso ti masirib gun-odenna ti pannacaammo; ket ti lapayag ti masirib agsapul iti pannacaammo.",
			"16": "<sup>16</sup> Ti sagut ti tao mangipaay kencuana iti pagnaan, ket yegna iti saclang dagiti naindaclan a tattao.",
			"17": "<sup>17</sup> Ti mangsalacnib iti calinteganna nga umuna cas la nalinteg; ngem ti caarrubana umay ket palutputenna.",
			"18": "<sup>18</sup> Ti panaggiginnasangasat pagsardengenna dagiti susic, ket bingbingayenna cadagiti nabileg.",
			"19": "<sup>19</sup> Ti cabsat a nadangranan narigrigat a gun-oden ngem ti napigsa a pagilian; ket dagiti cacasta a riri casda la balunet ti castillo.",
			"20": "<sup>20</sup> Ti tian ti tao mapunnonto iti bunga ti ngiwatna; iti mapatanor dagiti bibigna mapnecto.",
			"21": "<sup>21</sup> Patay ken biag addada iti pannacabalin ti dila; ket dagiti agayat kencuana canendanto ti bungana.",
			"22": "<sup>22</sup> Siasinoman a macasarac iti asawa a babai macasarac iti naimbag a banag, ken magun-odna ti parabur ni Jehova.",
			"23": "<sup>23</sup> Ti napanglaw agpacpacaasi, ngem ti nabacnang sumungbat a sigugubsang.",
			"24": "<sup>24</sup> Ti tao a mannakigayyem la unay pacadadaelanna met laeng; ngem adda gayyem a nadecdecket ngem cabsat."
		},
		"19": {
			"1": "<sup>1</sup> Nasaysayaat ti napanglaw a magna iti kinalinteg ngem ti naulpit cadagiti bibigna ken maag.",
			"2": "<sup>2</sup> Casta met, a ti cararua nga awan ammo saan a naimbag; ken ti agdarasudos cadagiti sacsacana bumasol.",
			"3": "<sup>3</sup> Ti kinamaag ti tao caracarenna ti dalanna; ket ti pusona agtanabutub a maicaniwas ken Jehova.",
			"4": "<sup>4</sup> Ti sanicua paaduenna dagiti gagayyem; ngem ti napanglaw maisina iti gayyemna.",
			"5": "<sup>5</sup> Ti natiri a sacsi saanto a di madusa; ket ti agyesngaw cadagiti ulbod dinto macalapsut.",
			"6": "<sup>6</sup> Adu dagiti agdawatto iti caasi ti managparabur a tao; ket amin a tao sigagayyem iti mangted cadagiti sagsagut.",
			"7": "<sup>7</sup> Amin dagiti cacabsat ti napanglaw gumurada kencuana: adadda pay nga umadayu dagiti gagayyemna kencuana! Agsasao a surutenna ida ngem awandan.",
			"8": "<sup>8</sup> Ti manggun-od iti kinasirib ayatenna ti cararuana met laeng, ti mangsalimetmet iti pannacaawat macasaracto iti imbag.",
			"9": "<sup>9</sup> Ti natiri a sacsi saanto a di madusa; ket ti agyesngaw cadagiti ulbod mapucawto.",
			"10": "<sup>10</sup> Ti nanam-ay a biag saan a mainugot iti maag; adadda manen a saan a ti maysa nga adipen iturayanna dagiti piprincipe.",
			"11": "<sup>11</sup> Ti kinamanagpanunot ti tao pagbalinenna a nabannayat nga agpungtot; ket ti dayawna ti panangpalabesna iti caniwas.",
			"12": "<sup>12</sup> Ti rungsot ti ari cas la uga ti maysa a leon; ngem ti paraburna cas la linnaaw nga agdisso iti root.",
			"13": "<sup>13</sup> Ti maag nga anac isu ti kinadangsangasat ni amana; ket dagiti ringringgor ti babai nga asawa isuda ti casla cancanayon a panagtedted.",
			"14": "<sup>14</sup> Balay ken kinabacnang tawiden ida cadagiti amma; ngem ti manakem a babai nga asawa aggapu ken ni Jehova.",
			"15": "<sup>15</sup> Ti kinasadut mangiturong iti nargaan a turog; ket ti cararua a nasadut agsagabanto iti bisin.",
			"16": "<sup>16</sup> Ti mangsalimetmet iti bilin salimetmetanna ti cararuana; ngem ti sililiway cadagiti dalanna matayto.",
			"17": "<sup>17</sup> Ti addaan caasi cadagiti napanglaw pabuludanna ni Jehova; ket ti naimbag nga aramidna bayadannanto nga isubli kencuana.",
			"18": "<sup>18</sup> Dusaem ni anacmo, idinto nga adda inanama; ngem dica igaed ta pusom iti pannacadadaelna.",
			"19": "<sup>19</sup> Ti tao a dackel ti rungsotna baclayennanto ti dusa; ta no ispalem, masapul nga ispalem manen.",
			"20": "<sup>20</sup> Ipangagmo ti patigmaan, ket awatem ti pannacaisuro, tapno masiribca intono camaudianan.",
			"21": "<sup>21</sup> Adu a pakinakem ti adda iti puso ti maysa a tao; ngem ti patigmaan ni Jehova, dayta agnayonto.",
			"22": "<sup>22</sup> Ti mamagbalin iti maysa a tao a pagrayoan isu ti kinamanagayatna; ngem nasaysayaat ti napanglaw a tao ngem iti managulbod.",
			"23": "<sup>23</sup> Ti panagbuteng ken ni Jehova agturong iti biag; ket ti addaan iti daytoy agtaengto a sipepennec; isu saanto a sarungcaran ti dakes.",
			"24": "<sup>24</sup> Ti nasadut ilumlumna ti imana iti pinggan, ket dinanto maidanon manen iti ngiwatna.",
			"25": "<sup>25</sup> Danarem ti managuyaw, ket ti nanengneng masursuronanto iti kinanacman; ken tubngarem ti adda pannacaawatna, ket maawatannanto ti pannacaammo.",
			"26": "<sup>26</sup> Ti nadawel ken amana ken pagtalawenna ni inana, inanac a mangibabain ken pacaumsian.",
			"27": "<sup>27</sup> Sardayam, anacco, ti dumngeg iti pannursuro ket isu laeng ti pacayawawanam cadagiti sasao ti pannacaammo.",
			"28": "<sup>28</sup> Ti awan cais-iscanna a sacsi rabrabngisenna ti kinajusticia; ket ti ngiwat ti kinadangkes agalimon iti kinadakes.",
			"29": "<sup>29</sup> Sisasaganan ti panangocom cadagiti managuyaw, ken sapsaplit iti bucot dagiti maag."
		},
		"20": {
			"1": "<sup>1</sup> Ti arac managrabrabac, ti naingel nga inumen managringringgor; ket siasinoman a mailaw-an kencuana saan a masirib.",
			"2": "<sup>2</sup> Ti pangkigtot ti ari cas panaguga ti leon; ti manggargari kencuana nga agpungtot macabasol iti biagna met laeng.",
			"3": "<sup>3</sup> Maysa a pacaidayawan ti maysa a tao ti icacayacayna iti ringgor; ngem amin a maag makiririnto.",
			"4": "<sup>4</sup> Ti nasadut saanto nga agarado gapu iti lam-ec; makilimosto ngarud no panagani, ket awanto ti mapaaddana.",
			"5": "<sup>5</sup> Ti patigmaan iti puso ti tao cas nauneg a danum; ngem ti tao a mannacaawat maaonnanto.",
			"6": "<sup>6</sup> Cadagiti caaduan a tattao tunggal maysa iwarnacna ti kinamanagayatna met laeng; ngem iti mapagtalcan a tao siasino ti macasarac?",
			"7": "<sup>7</sup> Ti nalinteg a tao a magna iti kinamatalecna, benditodanto dagiti annacna iti calpasanna.",
			"8": "<sup>8</sup> Ti ari nga agtugaw iti trono ti pangocoman wacnitanna babaen cadagiti matana ti amin a dakes.",
			"9": "<sup>9</sup> Siasino ti macaisao, dinalusacon ti pusoc, sidadalusac iti basolco?",
			"10": "<sup>10</sup> Dagiti agduduma a timbengan ken agduduma a sucatan, isuda agpapadada a macarimon ken ni Jehova.",
			"11": "<sup>11</sup> Uray ti ubing ipacaammona ti bagina cadagiti cababalinna, no nadalus man ti aramidna, wenno nalinteg.",
			"12": "<sup>12</sup> Ti macangngeg a lapayag, ken ti macakita a mata, agpadpadada nga inaramid ni Jehova.",
			"13": "<sup>13</sup> Dica ayaten ti turog, di la ket ta pumanglawca; luctam dagita matam, ket mapneccanto iti taraon.",
			"14": "<sup>14</sup> Dakes, dakes, cuna ti gumatang; ngem intono nacapanawen, agpasindayagen.",
			"15": "<sup>15</sup> Adda balitoc ken naruay a rubi; ngem dagiti bibig ti pannacaammo napategda nga alicamen.",
			"16": "<sup>16</sup> Alaem ti pagan-anay ti mangpatalged iti di-amammo, ket cas salda igawidmo ti mangpatalged cadagiti gangannaet.",
			"17": "<sup>17</sup> Ti tinapay ti kinaulbod nasam-it iti tao; ngem calpasanna ti ngiwatna mapnonto iti rinet.",
			"18": "<sup>18</sup> Amin a gandat pasingkedan ti panangpatigmaan; ket babaen ti nasirib a pannacaiturong makigubatca.",
			"19": "<sup>19</sup> Ti managipadamag nga agidanondanon agipalgac cadagiti palpalimed; dica ngarud makicuycuyog iti daydiay manginganga unay cadagiti bibigna.",
			"20": "<sup>20</sup> Siasinoman a mangilunod ken amana wenno inana, ti pagsilawanna maiddepto iti cangisitan ti sipnget.",
			"21": "<sup>21</sup> Ti tawid magun-od a nadaras iti damdamona; ngem ti panungpalanna saanto a nagasat.",
			"22": "<sup>22</sup> Dica cunaen, ibalesconto ti dakes; agpannurayca ken ni Jehova, ket isalacannacanto.",
			"23": "<sup>23</sup> Dagiti agduduma a timbengan macarimonda ken ni Jehova; ket ti naulbod a timbengan saan a nasayaat.",
			"24": "<sup>24</sup> Dagiti panagtignay ti tao cucua ni Jehova; casano ngarud ita ti pannacaawat ti tao iti dalanna?",
			"25": "<sup>25</sup> Maysa a pangsilo iti tao ti panagcuna a sidadaras, isu naidaton; ket iti calpasan ti panagcari agduadua.",
			"26": "<sup>26</sup> Ti masirib nga ari itaepna dagiti nadangkes, ket iparabawna cadacuada ti pilid a pagbayo.",
			"27": "<sup>27</sup> Ti espiritu ti tao pagsilawan ni Jehova, a mangsukisuc cadagiti amin a caungan a paspaset.",
			"28": "<sup>28</sup> Ti kinamanagayat ken kinapudno salacnibanda ti ari; ket ti tronona saranayen ti kinamanagayat.",
			"29": "<sup>29</sup> Ti dayaw dagiti agtutubo a lallaki isu ti kinapigsada; ket ti kinapintas dagiti lallacay isu ti olo nga ubanan.",
			"30": "<sup>30</sup> Dagiti saplit a sumugat ugasanda ti dakes; ket dagiti dandanog sucnorenda dagiti caungan a paspaset."
		},
		"21": {
			"1": "<sup>1</sup> Ti puso ti ari adda iti ima ni Jehova cas cadagiti pagayusan ti danum; iturongna iti sadinoman a pagayatanna.",
			"2": "<sup>2</sup> Tunggal dalan ti tao nalinteg cadagiti matana met laeng; ngem ni Jehova gantingenna dagiti puspuso.",
			"3": "<sup>3</sup> Ti panagaramid iti kinalinteg ken kinajusticia adadda a pacaayaywan ni Jehova ngem ti daton.",
			"4": "<sup>4</sup> Ti nangato a panagkitkita, ken ti natangsit a puso, uray pay ti pagsilawan silawan ti nadangkes, basol.",
			"5": "<sup>5</sup> Dagiti pampanunot ti nagaget agduyosda laeng iti panagrang-ay, ngem amin a naganat gumanat laeng nga agpanglaw.",
			"6": "<sup>6</sup> Ti pananggun-od cadagiti gamgameng gapu iti naulbod a dila isu ti alingasaw a pagalallicubengen dagiti agbiruc iti patay.",
			"7": "<sup>7</sup> Ti kinauyong dagiti nadangkes mangisagadto cadacuada, gapu ta madida nga agaramid iti kinalinteg.",
			"8": "<sup>8</sup> Ti dalan ti nacargaan iti babac napalalo a nagkillo; ngem no maipapan iti nadalus, ti aramidna nalinteg.",
			"9": "<sup>9</sup> Nasaysayaat ti agnaed iti suli ti toctoc ti balay, ngem ti pannakinaed iti mannakiringgor a babai iti nalawa a balay.",
			"10": "<sup>10</sup> Ti cararua ti nadangkes tarigagayanna ti dakes: ti caarrubana saan a macasarac iti parabur cadagiti matana.",
			"11": "<sup>11</sup> No madusa ti managuyaw, mapasirib ti nanengneng; ket no ti masirib maisuro, awatenna ti pannacaammo.",
			"12": "<sup>12</sup> Ti nalinteg a tao ototobenna ti balay ti nadangkes, no casano ti pannacaitublac dagiti nadangkes iti pannacarbada.",
			"13": "<sup>13</sup> Siasinoman a mangapput cadagiti lapayagna iti ickis ti napanglaw, isu umkisto met, ngem dinto maipangag.",
			"14": "<sup>14</sup> Ti sagut a nalimed pagtalnaenna ti pungtot; ket ti maysa a sagut iti saclot epepenna ti napigsa a rungsot.",
			"15": "<sup>15</sup> Rag-o iti nalinteg ti panagaramidna iti kinalinteg, ngem maysa a pannacadadael cadagiti agar-aramid iti kinadangkes.",
			"16": "<sup>16</sup> Ti tao a mayawawan iti dalan ti pannacaawat agtungpalto iti tallaong dagiti natay,",
			"17": "<sup>17</sup> Ti agayat iti panagayayam napanglawto a tao: ti agayat iti arac ken lana saanto a nabacnang.",
			"18": "<sup>18</sup> Ti nadangkes isu ti subbot ti nalinteg; ket ti mangliliput maisandi iti nalinteg.",
			"19": "<sup>19</sup> Nasaysayaat ti agnaed iti daga a langalang, ngem iti pannakinaed iti babai a mannakiringgor ken naalipunget.",
			"20": "<sup>20</sup> Adda napateg a gameng ken lana iti balay ti masirib; ngem ti maag a tao alimunenna ida.",
			"21": "<sup>21</sup> Ti mangsursurot iti kinalinteg ken kinamanagayat masaracanna ti biag, kinalinteg, ken dayaw.",
			"22": "<sup>22</sup> Ti masirib a tao ulienna ti ili ti napigsa, ket deppesenna ti bileg ti kinatalgedna.",
			"23": "<sup>23</sup> Siasinoman a mangsalimetmet iti ngiwat ken dilana salacnibanna ti cararuana cadagiti ducducot.",
			"24": "<sup>24</sup> Ti natangsit ken napalangguad a tao, managuyaw ti naganna; agaramid iti kinacuspag ti kinatangsit.",
			"25": "<sup>25</sup> Ti calicagum ti nasadut mamapatay kencuana; ta dagiti im-imana madida nga agbannog.",
			"26": "<sup>26</sup> Adda agagum a narawet nga agmalmalem; ngem ti nalinteg mangted ken di-agmedmed.",
			"27": "<sup>27</sup> Ti daton ti nadangkes maysa a kinarimon; adadda pay no ipaayna a sidadangkes ti panunotna!",
			"28": "<sup>28</sup> Ti natiri a sacsi mapucawto; ngem ti tao a macangngeg agsaonto tapno agtalinaed.",
			"29": "<sup>29</sup> Ti nadangkes a tao irupangetna ti rupana; ngem no ti nalinteg, patibkerenna dagiti daldalanna.",
			"30": "<sup>30</sup> Awan ti kinasirib wenno pannacaawat wenno patigmaan a maicaniwas ken ni Jehova.",
			"31": "<sup>31</sup> Ti cabayo maisagana a maipaay iti aldaw ti gubat ngem ti balligi biang ni Jehova."
		},
		"22": {
			"1": "<sup>1</sup> Ti naimbag a pacasasaoan adadda a pilien ngem iti dackel a kinabacnang, ket ti naayat a parabur adadda ngem pirac ken balitoc.",
			"2": "<sup>2</sup> Dagiti nabacnang ken napanglaw agsasaracda: ni Jehova ti namarsua cadacuada amin.",
			"3": "<sup>3</sup> Ti manakem a tao madlawna ti dakes, ket aglemmeng; ngem ti nanengneng aglayon laeng ket agsagaba.",
			"4": "<sup>4</sup> Ti gunguna ti napacumbaba ken panagbuteng ken Jehova, kinabacnang, dayaw, ken biag.",
			"5": "<sup>5</sup> Sisiit ken silsilo addada iti dalan ti naulpit: ti mangsalimetmet iti cararuana siadayunto cadacuada.",
			"6": "<sup>6</sup> Iruammo ti ubing iti dalan a rebbengna a papanan, ket uray intono lacayen saannanto a pagpanawan.",
			"7": "<sup>7</sup> Ti nabacnang iturayanna ti napanglaw; ket ti umutang adipen ni nagpautang.",
			"8": "<sup>8</sup> Ti agmula ti kinadangkes agapitto iti kinadacsangasat; ket ti pang-or ti rungsotna cumapuyto.",
			"9": "<sup>9</sup> Ti addaan naparabur a mata benditonto; ta mangted iti tinapayna cadagiti napanglaw.",
			"10": "<sup>10</sup> Pagtalawem ti mananguyaw, ket ti ringgor pumanawto; wen, ti ringgor ken pannacaibabain agsardengto.",
			"11": "<sup>11</sup> Ti agayat iti kinadalus ti puso, gapu iti talunggading dagiti bibigna ti ari gayyemnanto.",
			"12": "<sup>12</sup> Dagiti mata ni Jehova salacnibanda ti addaan pannacaammo; ngem rebbekenna dagiti sasao ti nagulib a tao.",
			"13": "<sup>13</sup> Ti nasadut cunana, Adda leon idiay ruar; mapisangpisangacto iti lanlansangan.",
			"14": "<sup>14</sup> Ti ngiwat ti gangannaet a babai nauneg a dariwangwang: ti guraen ni Jehova matnagto sadiay.",
			"15": "<sup>15</sup> Ti kinamaag maicapet iti puso ti ubing; ngem ti pagbaot ti pannursuro iccatennanto nga yadayu kencuana.",
			"16": "<sup>16</sup> Ti mangparigat iti napanglaw tapno mapaaduna ti magungunana, ken ti mangted iti nabacnang, pumanglawto laeng.",
			"17": "<sup>17</sup> Yallingagmo ta lapayagmo, ket denggem dagiti sasao ti masirib, ket isaadmo ta pusom iti pannacaammoc.",
			"18": "<sup>18</sup> Ta nacaay-ayo a banag no cupicupam ida ita unegmo, no mapasingkedanda amin cadagita bibigmo.",
			"19": "<sup>19</sup> Tapno ti panagtalecmo adda coma ken ni Jehova, impacaammoc ida kenca itoy nga aldaw, wen kenca.",
			"20": "<sup>20</sup> Saanco aya nga insurat kenca dagiti mangnibinibi a banbanag maipapan cadagiti balbalacad ken pannacaammo.",
			"21": "<sup>21</sup> Tapno maipacaammoc kenca ti kinaagpayso dagiti sasao ti pudno, tapno maisublim coma dagiti sasao ti pudno cadagiti mangibaon kenca?",
			"22": "<sup>22</sup> Dica tacawan ti napanglaw, gapu ta napanglaw; dica met parigaten ti sililiday iti ruangan:",
			"23": "<sup>23</sup> Ta ni Jehova icanawananto ti biangda, ket rabsutennanto ti biag dagiti mangrabsut cadacuada.",
			"24": "<sup>24</sup> Dica makigayyem iti tao a managpungtot; ket iti narungsot a tao dicanto makicuyog:",
			"25": "<sup>25</sup> Di la ket ta masursurom dagiti daldalanna, ken macaalaca iti silo iti cararuam.",
			"26": "<sup>26</sup> Saanca coma a maysa cadagiti mangyunnat cadagiti im-imada, wenno cadagiti mangpatalged cadagiti ut-utang:",
			"27": "<sup>27</sup> No awanto ti pagbayadmo, apay nga alaendanto ta iddam ita babam?",
			"28": "<sup>28</sup> Dica yalis ti cadaanan a dolon, nga incabil dagiti dadackelmo.",
			"29": "<sup>29</sup> Makitam ti maysa a tao a sireregta iti pagsapulanna? agtacderto iti saclang dagiti ar-ari; dinto agtacder iti saclang dagiti nanomo a tattao."
		},
		"23": {
			"1": "<sup>1</sup> No tumugawca a makipangan iti agturay, pampanunotem a siaanep ti adda iti sangom;",
			"2": "<sup>2</sup> Ket iccam iti maysa nga immoco ta carabucobmo, no maysaca a tao a mannangan.",
			"3": "<sup>3</sup> Dica aggartem cadagiti naimas a canenna; ta taraon ida a mangallilaw.",
			"4": "<sup>4</sup> Dica maringgoran a bumacnang; agtalnaca gapu ita kinasiribmo met laeng.",
			"5": "<sup>5</sup> Itaengmonto aya dagiti matam iti daydiay awan? Ta dagiti kinabacnang pudno nga agcayabcabda, cas iti aguila a tumayab nga agpalangit.",
			"6": "<sup>6</sup> Dica mangan iti tinapay ti nadangkes ti matana, dica met garteman dagiti naimas a canenna:",
			"7": "<sup>7</sup> Ta cas iti panpanunotenna iti unegna, isu casta met: manganca ken uminumca, cunana kenca; ngem ti pusona awan kenca.",
			"8": "<sup>8</sup> Ti sangcasacmol a kinnanmo isaruamto, ket mapucawmonto dagiti nasam-it a sasaom.",
			"9": "<sup>9</sup> Dica agsao iti pagdengngeg ti maag; ta uyawennanto ti kinasirib dagiti sasaom.",
			"10": "<sup>10</sup> Dica iyalis ti cadaanan a dolon; dica met lumas-ud cadagiti dagdaga dagiti ululila:",
			"11": "<sup>11</sup> Ta ti Manubbot cadacuada napigsa, isu salacnibannanto ti calinteganda a maibusor kenca.",
			"12": "<sup>12</sup> Ipaaymo ta pusom iti sursuro, ken dagiti lapayagmo cadagiti sao ti pannacaammo.",
			"13": "<sup>13</sup> Dica igawid ti panangpatigmaan iti ubing; ta no baotem, saanto a matay.",
			"14": "<sup>14</sup> Baotemto, ket maispalmonto ti cararuana iti patay.",
			"15": "<sup>15</sup> Anacco, no ta pusom masirib, uray siac, toy pusoc maragsacanto met:",
			"16": "<sup>16</sup> Wen, ti pusoc agrag-onto, no dagiti bibigmo agsaoda cadagiti nalinteg a banbanag.",
			"17": "<sup>17</sup> Ta pusom di coma umapal cadagiti managbasol; ngem adda coma laeng iti panagbuteng ken ni Jehova iti agmalmalem;",
			"18": "<sup>18</sup> Ta di bumurong nga addanto gunguna; ket ti inanamam saanto a matungday.",
			"19": "<sup>19</sup> Dumngegca, anacco, ket agsiribca, ken iturongmo ta pusom iti dalan.",
			"20": "<sup>20</sup> Dica makitipon cadagiti mangnginum iti arac; cadagiti narawet nga agsida iti lasag:",
			"21": "<sup>21</sup> Ta ti mammartec ken nabuclis pumanglawdanto; ket ti saguyepyep cawesannanto ti tao iti rutayrutay.",
			"22": "<sup>22</sup> Ipangagmo ni amam a nagputot kenca, ken dica lalaisen ni inam intono bumaket.",
			"23": "<sup>23</sup> Gatangem ti pudno, ken dica lacoen; wen, kinasirib, sursuro, ken pannacaawat.",
			"24": "<sup>24</sup> Ti ama ti nalinteg agragrag-onto unay; ket ti nagputot iti masirib nga ubing maragsacanto kencuana.",
			"25": "<sup>25</sup> Maragsacan coma da amam ken inam, ket agrag-o coma ti nangipasngay kenca.",
			"26": "<sup>26</sup> Anacco, itdem caniac ta pusom; ket dagiti matam pagayatanda coma dagiti daldalanco.",
			"27": "<sup>27</sup> Ta ti balangcantis paayas a mangliwengliweng, ket ti babai a gangannaet dariwangwang a nailet.",
			"28": "<sup>28</sup> Wen, isu agsaneb a cas tulisan, ket paaduenna dagiti nagulib cadagiti tattao.",
			"29": "<sup>29</sup> Siasino ti addaan ay-ayen? siasino ti addaan ladingit? siasino ti addaan ringringgor? Siasino ti addaan asug? siasino ti addaan sugat nga awan gapgapuna? Siasino ti addaan labbasit dagiti matana?",
			"30": "<sup>30</sup> Dagiti agtalinaed a napaut iti arac; dagiti mangbirbiruc iti naggampor nga arac.",
			"31": "<sup>31</sup> Dica mingmingan ti arac no nalabaga, no cumilapkilap iti uneg ti copa. No agpababa a silalamuyot:",
			"32": "<sup>32</sup> Panungpalanna cumagat a casla uleg, ket sumippit a cas carasaem.",
			"33": "<sup>33</sup> Dagiti matam maimatangandanto dagiti datdatlag a kita, ket ta pusom agyebcasto cadagiti naulpit a banbanag.",
			"34": "<sup>34</sup> Wen, cascanto laeng itay agidda iti tengnga ti taaw, wenno cas itay agidda iti mordong ti palo ti sasacayan.",
			"35": "<sup>35</sup> Kinabildac, cunaemto, ket saanac a nadunor; binabaotdac, ket diac naricna: caanonto ti panagriingco? Birukecto pay manen."
		},
		"24": {
			"1": "<sup>1</sup> Dica apalan dagiti dakes a tattao; dica met esman ti makicaddua cadacuada:",
			"2": "<sup>2</sup> Ta ti pusoda adadalenda ti panangparigat, ket cadagiti bibigda agsaoda iti rangranggas.",
			"3": "<sup>3</sup> Gapu iti kinasirib mapatacder ti balay; ket gapu iti pannacaawat mapasingkedan;",
			"4": "<sup>4</sup> Ket gapu iti pannacaammo mapnodanto dagiti silsiled iti amin a napateg ken nacay-ayo a kinabacnang.",
			"5": "<sup>5</sup> Ti masirib a tao napigsa; wen, ti tao a mannacaammo degdeganna ti bilegna.",
			"6": "<sup>6</sup> Ta gapu iti nasirib a panangidalan aramidento ti pannakigubatmo; ket ti pannacaispal adda iti kinaadu dagiti cabalanbalacad.",
			"7": "<sup>7</sup> Ti kinasirib nangato unay iti maag: dina inganga ti ngiwatna iti ruangan.",
			"8": "<sup>8</sup> Ti agpakinakem nga agaramid iti dakes, dagiti tattao naganendanto iti managranggas.",
			"9": "<sup>9</sup> Ti panunot ti kinamaag basol; ket ti managuyaw macarimon cadagiti tattao.",
			"10": "<sup>10</sup> No cumapsutca iti aldaw ti pagpaglan, ti pigsam bassit.",
			"11": "<sup>11</sup> Ispalem dagiti maipan ken patay, ket dagidiay a maisagana a mapapatay kitaem ta igawidmo ida.",
			"12": "<sup>12</sup> No cunam, Adtoy, dicami naammoam daytoy; saan aya nga isisipen ti mangganting cadagiti puspuso? Ket ti mangsalimetmet ita cararuam, dina aya ammo? Ket dinanto aya isupapac iti tunggal tao ti caanatop ti aramidna?",
			"13": "<sup>13</sup> Anacco, manganca iti diro, ta naimbag; ken dagiti tedted ti rara, isuda a nasam-it ita panagnanammo:",
			"14": "<sup>14</sup> Iti casta maammoam a ti kinasirib adda dita cararuam; no nasaracamon, daydiay, addanto ngarud gunguna, ket ti inanamam dinto matungdayen.",
			"15": "<sup>15</sup> Dica siblocan, O nadangkes a tao, ti balay ti nalinteg; dica racraken ti paginanaanna:",
			"16": "<sup>16</sup> Ta ti nalinteg a tao uray matuang a maminpito, ket bumangon manen; ngem dagiti nadangkes rebbeken ida ti kinadacsangasat.",
			"17": "<sup>17</sup> Dica agrag-o no mapasag ti cabusormo, ken saan coma a maragsacan ta pusom no isu marbec;",
			"18": "<sup>18</sup> Di la ket ta makita ni Jehova, ket saan a maayayo, ket ipanawna kencuana ti pungtotna.",
			"19": "<sup>19</sup> Dica agalimuteng a gapu cadagiti managdacdakes: dica met apalan dagiti nadangkes:",
			"20": "<sup>20</sup> Ta awanto ti gunguna iti dakes a tao; ti pagsilawan ti nadangkes maiddepto.",
			"21": "<sup>21</sup> Anacco, agbutengca ken ni Jehova ken iti ari; ket dica makicuyog cadagiti managbalbaliw:",
			"22": "<sup>22</sup> Ta ti kinadacsangasatda tumpuarto a pettat; ket ti pannacadadael nga agtaud cadacuada a dua, asino ti macaammo?",
			"23": "<sup>23</sup> Dagitoy sasao met ti masirib; ti panangidumduma cadagiti tattao iti panangocom saan a naimbag.",
			"24": "<sup>24</sup> Ti agcuna iti nadangkes, Sica nalintegca; ilunodto dagiti inilin-ili, ket dagiti nasnacion guraendanto:",
			"25": "<sup>25</sup> Ngem cadagiti mangtubngar kencuana addanto rag-o, ket ti naimbag a gasat umayto cadacuada.",
			"26": "<sup>26</sup> Agcanna dagiti bibig daydiay mangipaay iti nalinteg a sungbat.",
			"27": "<sup>27</sup> Iwayatmo ti aramidmo iti ruar, ket saganaem a maipaay kenca iti away; ket calpasanna bangonemto ti balaymo.",
			"28": "<sup>28</sup> Saanca nga agsacsi iti maibusor iti caarrubam nga awan gapgapuna; ket dica mangallilaw babaen cadagiti bibigmo.",
			"29": "<sup>29</sup> Dica cunaen, aramidecto kencuana cas ti inaramidna caniac; isupapacconto iti tao ti mayanatop iti aramidna.",
			"30": "<sup>30</sup> Limmabasac ti ticub ti nasadut, ken iti asideg ti inuvasan ti awanan pannacaawat;",
			"31": "<sup>31</sup> Ket, adtoy isu-amin nagtuboanen ti sisiit, ket ti rabawna nacumotanen iti calunay, ket ti cabiti a bacudna nargaayen.",
			"32": "<sup>32</sup> Idi a casta minatmatac, ket inot-otobco a nalaing; nakitac, ket nacaalaac iti sursuro:",
			"33": "<sup>33</sup> Bassit pay a pannaturog, bassit a ridep, bassit a panagkepkep dagiti ima tapno maturog;",
			"34": "<sup>34</sup> Iti casta umayto ti kinapanglawmo a cas mannanacaw, ken ti panagkirangmo a cas nagtagiigam a tao."
		},
		"25": {
			"1": "<sup>1</sup> Dagitoy met proverbios ida ni Salomon, a sinacar dagiti tattao ni Ezequias nga ari ti Juda.",
			"2": "<sup>2</sup> Dayaw ti Dios ti panangilimed iti maysa a banag; ngem dayaw dagiti ar-ari ti panangsukimatda iti maysa a banag.",
			"3": "<sup>3</sup> Cas iti cangato dagiti langlangit ken iti cauneg ti daga, casta a saan a masukimat ti puso dagiti ar-ari.",
			"4": "<sup>4</sup> No maiccat ti lati ti pirac, rumsuanto ti aruaten a maipaay ti agtuntunaw:",
			"5": "<sup>5</sup> No maiccat ti nadangkes iti saclang ti ari, ti tronona mapasingkedanto iti kinalinteg.",
			"6": "<sup>6</sup> Dica itantan-oc ti bagim iti sangoanan ti ari, ket dica agtacder iti ayan dagiti natan-oc a tattao:",
			"7": "<sup>7</sup> Ta nasaysayaat a macunanto kenca, ngumatoca ditoy, ngem ti pannacaipababamto iti sangoanan ti principe, isu a nakita dagiti matam.",
			"8": "<sup>8</sup> Dica agdarasudos a makiringgor, di la ket ta dicanto ammo ti aramidem iti tungpalna, intono ti caarrubam mapabainannacan",
			"9": "<sup>9</sup> Isusicmo ti calintegan iti caarrubam met laeng, ket dica ipalgac ti palimed ti sabali;",
			"10": "<sup>10</sup> Di la ket ta ti macangngeg ababiennaca, ket ti pannacaibabainmo saan a mapunasen.",
			"11": "<sup>11</sup> Ti sao a maitutop ti pannacaisaona cas la mansanas a balitoc a nabungon iti iniket a pirac.",
			"12": "<sup>12</sup> Cas aritos a balitoc, ken alajas a nasudi a balitoc,   casta ti masirib a mangtubngar iti natulnog a lapayag.",
			"13": "<sup>13</sup> Cas iti lamiis ti nieve iti panagani, casta ti matalec a baonen iti nangibaon kencuana; ta palamiisanna ti cararua dagiti apapona.",
			"14": "<sup>14</sup> Cas ululep ken angin nga awan tudona,   casta ti mangipasindayag a siulbod cadagiti sagsagutna.",
			"15": "<sup>15</sup> Iti napaut a panagitured mauyotan ti agturay, ti nalucneng a dila burakenna ti tulang.",
			"16": "<sup>16</sup> Nacasaracca aya ti diro? canem laeng ti umanay kenca, di la ket ta mabsugca unay, ket isaruam.",
			"17": "<sup>17</sup> Ta sacam manmano coma ti caaddana iti balay ti caarrubam, di la ket ta mauma kenca, ket guraennaca.",
			"18": "<sup>18</sup> Ti tao nga agsacsi iti ulbod a maibusor iti caarrubana isu ti pang-or, campilan, ken natirad a pana.",
			"19": "<sup>19</sup> Ti panagtalec iti tao a di matalec iti tiempo ti pagducotan cas napusi a ngipen, ken saca a nagtungngalib.",
			"20": "<sup>20</sup> Cas iti maysa a mangocsob iti pagananayna iti tiempo a nalam-ec, ken cas masucaan a soda, casta ti mangicanta cadagiti cancanta iti maysa a puso a sibabantut.",
			"21": "<sup>21</sup> No mabisin ti cabusormo, iccam iti taraon a canenna; ket no mawaw iccam iti danum nga inumenna:",
			"22": "<sup>22</sup> Ta iti casta gabsoonam ti beggang ti apuy iti olona, ket ni Jehova gungunaannacanto.",
			"23": "<sup>23</sup> Ti angin nga amian iparangna ti tudo: casta ti aramiden ti managtanabutob a dila iparangna ti naunget a langa.",
			"24": "<sup>24</sup> Nasaysayaat ti agnaed iti maysa a suli ti toctoc ti balay, ngem ti pannakinaed iti mannakiringgor a babai iti nalawa a balay.",
			"25": "<sup>25</sup> Cas nalamiis a danum iti mawaw a cararua, casta dagiti naimbag a damdamag nga aggapu iti adayu a daga.",
			"26": "<sup>26</sup> Cas nakibur a burayoc ken nabungsot nga ubbog, Casta ti nalinteg a tao nga agsanud iti sangoanan ti nadangkes.",
			"27": "<sup>27</sup> Saan a nasayaat ti pannangan iti adu a diro: casta met iti tao ti panagbirucda iti dayawda met laeng nacas-ang.",
			"28": "<sup>28</sup> Daydiay a ti espirituna awanan panangtengngel cas maysa nga ili a margaay ken awan bacudna."
		},
		"26": {
			"1": "<sup>1</sup> Cas nieve iti calgaw, ken cas tudo iti panagani, casta a ti dayaw saan a mayarnged iti maag.",
			"2": "<sup>2</sup> Cas iti billit-tuleng iti panagtawtawatawna, cas iti salsallapingaw iti panagtayabna, casta ti lunod nga awan gapgapuna saan nga agdisso.",
			"3": "<sup>3</sup> Ti baot maipaay iti cabayo, ti freno iti asno, ket ti pang-or iti bucot dagiti maag.",
			"4": "<sup>4</sup> Dica makisungbat iti maag a cas iti kinamaagna, di la ket ta maipadpadca met kencuana.",
			"5": "<sup>5</sup> Sungbatam ti maag cas maiparbeng iti kinamaagna, tapno saan nga agsirib cadagiti matana met laeng.",
			"6": "<sup>6</sup> Ti mangibaon iti maysa a pacdaar a maipaiggem iti maag. Pucolanna ti sacana met laeng, ken inumenna ti pacairurumenan.",
			"7": "<sup>7</sup> Dagiti sacsaca ti pilay agbibitin a silulupoy: casta ti pangngarig iti ngiwat dagiti maag.",
			"8": "<sup>8</sup> Cas ti maysa a mangigalut iti bato iti palatibong, casta ti mangipaay iti dayaw iti maag.",
			"9": "<sup>9</sup> Cas maysa a siit a maisalugsug iti ima ti nabartec, casta ti pangngarig iti ngiwat dagiti maag.",
			"10": "<sup>10</sup> Cas ti pumapana a sugatenna amin, casta ti manangdan iti maag ken ti manangdan cadagiti lumabas.",
			"11": "<sup>11</sup> Cas iti aso nga agsubli iti saruana, casta ti maag a mangsunot iti kinamaagna.",
			"12": "<sup>12</sup> Makitam ti maysa a tao a masirib cadagiti matana met laeng? Adadda ti namnama iti maysa a maag ngem iti daydiay.",
			"13": "<sup>13</sup> Ti nasadut cunana, Adda leon idiay dalan; adda leon cadagiti lanlansangan.",
			"14": "<sup>14</sup> Cas iti panagpuspus ti rikep ti ruangan iti nacaisigoanna, casta ti aramiden tay nasadut idiay iddana.",
			"15": "<sup>15</sup> Ti nasadut ilumlumna ti imana iti pinggan, ket isu mautuyan iti panangidanonna iti ngiwatna.",
			"16": "<sup>16</sup> Ti nasadut nasirsirib cadagiti matana met laeng ngem cadagiti pito a tattao a macaammo a sumungbat.",
			"17": "<sup>17</sup> Ti lumabas ket macapungtot iti ringgor nga awan bibiangna, cas itay mangtiliw iti aso a lapayagenna.",
			"18": "<sup>18</sup> Cas itay mauyong nga agipurruac iti aluten, panpana, ken patay;",
			"19": "<sup>19</sup> Casta ti tao a mangallilaw iti caarrubana, ket cunana, Saanac aya nga agrabrabac laeng ita?",
			"20": "<sup>20</sup> Gapu ti caawan ti pagsungrod maiddep ti apuy; ket no awan ti agdaydayengdeng, agsardeng ti riri.",
			"21": "<sup>21</sup> Cas ti uging parayrayenna dagiti beggang, ken ti sungrod iti apuy; casta ti mannakiriri a tao parayrayenna ti ringgor.",
			"22": "<sup>22</sup> Dagiti sasao ti agdaydayengdeng arigda la naimas a cancanen, ket dumanonda iti caungan a paset.",
			"23": "<sup>23</sup> Dagiti bibig a tarabitab ken ti nadangkes a puso arigda la bacca a damili a nacalupcupan iti lati ti pirac.",
			"24": "<sup>24</sup> Ti gumurgura mangallilaw cadagiti bibigna; ngem penpenenna ti ulbod iti unegna:",
			"25": "<sup>25</sup> No nasayaat ti panagsaona, saanmo a patpatien; ta adda pito a macarimon idiay pusona:",
			"26": "<sup>26</sup> Nupay ti gurana abbonganna iti kinasicap, ti kinadangkesna maiparangarangto a sibabatad iti saclang ti gimong.",
			"27": "<sup>27</sup> Siasinoman a mangcali iti palab-og isu matnagto idiay; ket ti mangitulatid iti bato, agsublinto daydiay a mangladdit kencuana.",
			"28": "<sup>28</sup> Ti naulbod a dila guraenna ti nadanarna; ket ti napasablog a ngiwat mamataud iti pannacadadael."
		},
		"27": {
			"1": "<sup>1</sup> Dica pagpasindayaw ti aldaw no bigat; ta dica ammo ti mapagteng iti maysa nga aldaw.",
			"2": "<sup>2</sup> Sabali laeng a tao ti mangidayaw coma kenca, ket saan a ta ngiwatmo met laeng; ti gangannaet, ket saan a dagiti met la bibigmo.",
			"3": "<sup>3</sup> Ti bato nadagsen, ket ti darat maganting; ngem ti pungtot ti maag nadagdagsen ngem isuda a dua.",
			"4": "<sup>4</sup> Ti rungsot nadawel, ket ti pungtot mangiremrem; ngem siasino ti macabalin nga agtacder iti saclang ti kinaimon?",
			"5": "<sup>5</sup> Nasaysayaat ti nabatad a panangtubngar ngem ti ayat a mailemlemmeng.",
			"6": "<sup>6</sup> Natalec dagiti panangdanar ti gayyem; ngem nabuslon dagiti agep ti cabusor.",
			"7": "<sup>7</sup> Ti sipepennec a cararua masuya iti rara; ngem iti carurua a mabisinan amin a napait nasam-it.",
			"8": "<sup>8</sup> Cas ti tumatayab nga adayuanna ti umocna, casta ti maysa a tao nga adayuanna ti taengna.",
			"9": "<sup>9</sup> Ti lana ken bangbanglo paragsakenda ti puso; casta met ti kinasam-it ti napusoan a balacad ti gayyem ti maysa a tao.",
			"10": "<sup>10</sup> Ti gayyemmo met laeng, ken ti gayyem ni amam, dica baybay-an; ket dica mapan iti balay ni cabsatmo iti aldaw ti kinadacsangasatmo: nasaysayaat ti caarruba nga adda iti asideg ngem ti cabsat nga adayu.",
			"11": "<sup>11</sup> Anacco, agsiribca, ket paragsakem toy pusoc, tapno masungbatac ti mangumsi caniac.",
			"12": "<sup>12</sup> Ti manakem a tao mabigbigna ti dakes, ket aglemmeng; ngem ti nanengneng aglayon laeng, ket agsagaba.",
			"13": "<sup>13</sup> Alaem ti pagan-anay ti mangpatalged iti dina am-ammo; ket igawidmo a sandi ti mangpatalged iti babai a gangannaet.",
			"14": "<sup>14</sup> Ti mangbendito iti gayyemna iti natbag a timecna, nga agriing a masapa iti bigat, maibilangto a lunod kencuana.",
			"15": "<sup>15</sup> Ti cancanayon a panagtedted iti natutudo nga aldaw ken ti mannakiringgor a babai agpadada a dua:",
			"16": "<sup>16</sup> Ti mangigawid coma kencuana mangigawid iti angin; ket ti canawan nga imana maisalapon iti lana.",
			"17": "<sup>17</sup> Ti landoc patademenna ti landoc; casta met ti tao patademenna ti langa ti gayyemna.",
			"18": "<sup>18</sup> Siasinoman nga agaywan iti cayo nga higos canennanto ti bungana; ket ti mangipatpateg iti apona madaydayawto.",
			"19": "<sup>19</sup> Cas iti danum ti rupa iyaninawna ti rupa, casta met ti puso ti tao ken tao.",
			"20": "<sup>20</sup> Da Tanem ken Dadael saanda a mapnec uray caanoman; ket dagiti matmata ti tao saanda a mapnec.",
			"21": "<sup>21</sup> Ti pagguguran maipaay iti pirac, ken ti horno iti balitoc; ket ti tao masuut gapu iti pannacaidaydayawna.",
			"22": "<sup>22</sup> Uray ngata no begbegem ti maag iti alsong agraman iti al-o a mailaoc iti mabayo a bagas. Nupay casta dinto pumanaw kencuana ti kinamaagna.",
			"23": "<sup>23</sup> Gagetam nga ammoen ti casasaad dagiti pangenmo, ken imatangam a naimbag dagiti arbanmo:",
			"24": "<sup>24</sup> Ta dagiti sanicua saanda nga agnanayon; ket ti balangat agpautto aya agingga cadagiti amin a caputotan?",
			"25": "<sup>25</sup> Ti garami macasacas, ket ti naganus a root agparang, ket dagiti mulmula cadagiti banbantay maapit.",
			"26": "<sup>26</sup> Dagiti cordero agservida iti pagananaymo, ket dagiti calding isuda ti pateg ti tay-acmo;",
			"27": "<sup>27</sup> Ket addanto gatas ti calding nga umanay a taraonmo, ken taraon ti familiam, ken pagtaraken cadagiti babbalasangmo."
		},
		"28": {
			"1": "<sup>1</sup> Dagiti nadangkes agtalawda idinto nga awan ti tao a mangcamat, ngem dagiti nalinteg situturedda a cas leon.",
			"2": "<sup>2</sup> Gapu iti kinasalungasing ti daga adu dagiti agturayna; ngem gapu cadagiti tao nga addaan pannacaawat ken pannacaammo ti casasaadna agnanayonto.",
			"3": "<sup>3</sup> Ti macurcurangan a tao a mamarigat cadagiti napanglaw cas la mangikisap a tudo nga awan tiddaenna a taraon.",
			"4": "<sup>4</sup> Dagiti mangbaybay-a iti linteg ipadpadayawda dagiti nadangkes; ngem dagiti mangsalimetmet iti linteg makisuppiatda cadacuada.",
			"5": "<sup>5</sup> Dagiti dakes a tattao dida maawatan ti kinalinteg; ngem dagiti mangbiruc ken Jehova maawatanda amin a banbanag.",
			"6": "<sup>6</sup> Nasaysayaat ti napanglaw a magna iti kinasingpetna, ngem ti naulpit cadagiti dalanna, nupay nabacnang.",
			"7": "<sup>7</sup> Ti mangsalimetmet iti linteg anac a masirib: ngem ti makicuyog cadagiti nabuclis ibabainna ni amana.",
			"8": "<sup>8</sup> Ti mangnayon iti cucuana gapu iti panagpaanac ken panagpatubo, iyurnonganna daydiay nadongngo cadagiti napanglaw.",
			"9": "<sup>9</sup> Ti di mangyallingag iti lapayagna iti panangdengngegna iti linteg, uray pay ti cararagna macarimon.",
			"10": "<sup>10</sup> Ti mangiturong cadagiti nalinteg iti dakes a dalan, matnagto met laeng iti palab-ogna; ngem dagiti napnoan-imbag agtawiddanto iti imbag.",
			"11": "<sup>11</sup> Ti nabacnang a tao masirib iti bucodna a panangipagarup; ngem ti napanglaw a mannacaawat ubogenna.",
			"12": "<sup>12</sup> No agballigi ti nalinteg, adda dackel a dayag; ngem no ngumato dagiti nadangkes, dagiti tattao aglemmengda.",
			"13": "<sup>13</sup> Ti mangabbong cadagiti salungasingna dinto rumang-ay; ngem ti mangipudno ken mangbaybay-an cadacuada maragpatnanto ti caasi.",
			"14": "<sup>14</sup> Nagasat ti tao a sibubuteng a cancanayon iti dakes ngem ti mangipatangken iti pusona matuangto iti pacadadaelan.",
			"15": "<sup>15</sup> Cas leon nga aguga, ken oso nga agsawar, casta ti nadangkes nga agturay iti napanglaw nga umili.",
			"16": "<sup>16</sup> Ti principe nga agcurang iti pannacaawat dackel met a mamarigat; ngem ti manggura iti kinaagum mapaatiddugnanto dagiti aldawna.",
			"17": "<sup>17</sup> Ti tao a mapabaclayan ti dara ti siasinoman a tao aglemmengto iti dariwangwang; awan coma ti mangigawid kencuana.",
			"18": "<sup>18</sup> Ti magna a sililinteg maispalto; ngem ti naulpit cadagiti dalanna matuangto a dagus.",
			"19": "<sup>19</sup> Ti mangtrabajo iti dagana addaanto ti naruay a taraon; ngem ti sumurot cadagiti ubbaw a tattao naananayto ti kinapanglawna.",
			"20": "<sup>20</sup> Ti matalec a tao aglaplapusananto cadagiti bendicion; ngem ti sigaganat a bumacnang saanto a di madusa.",
			"21": "<sup>21</sup> Ti panamagduduma cadagiti tattao saan a nasayaat; saan met a nasayaat a sumalungasing ti maysa a tao gapu iti sangcasacmol a taraon.",
			"22": "<sup>22</sup> Ti dakes ti matana gumanat iti panagbacnang, ket dina ammo a ti pannacacurang dumtengto kencuana.",
			"23": "<sup>23</sup> Ti mangtubngar iti tao adadunto a parabur ti masaracanna iti calpasanna, ngem ti mangpasablog babaen ti dilana.",
			"24": "<sup>24</sup> Ti tacawanna ni amana wenno ni inana, ket cunana, Saan a caniwas, isu ti cadua ti mangdadael.",
			"25": "<sup>25</sup> Ti narawet ti espirituna paltuadenna ti ringgor: ngem ti agcammatalec ken ni Jehova mapalucmegto.",
			"26": "<sup>26</sup> Ti agcammatalec iti pusona met laeng maag; ngem uray siasino a magna a nainsiriban maispalto.",
			"27": "<sup>27</sup> Ti mangted iti napanglaw dinto macurangan; ngem ti mangilinged cadagiti matana adunto ti pannacailunodna.",
			"28": "<sup>28</sup> No macangato dagiti nadangkes, aglemmeng dagiti tattao; ngem no mapucawda, umadu dagiti nalinteg."
		},
		"29": {
			"1": "<sup>1</sup> Ti tao nga idinto a masansan a matubngar ipatangkenna ti teltelna maclaatto a madadael, ket dayta awan ti pamuspusanen.",
			"2": "<sup>2</sup> No dagiti nalinteg umaduda, ti umili agragrag-o; ngem no agturay ti nadangkes a tao, ti umili sumasainnec.",
			"3": "<sup>3</sup> Ti mangayat iti kinasirib paragsakenna ni amana; ngem ti makicadcadua cadagiti balangcantis runotenna ti cucuana.",
			"4": "<sup>4</sup> Ti ari gapu iti kinajusticia pabilgenna ti daga; ngem daydiay nga agkiddaw iti sagsagut reggaayenna.",
			"5": "<sup>5</sup> Ti tao a mangpaspasablog iti caarrubana, mangyucrad iti iket cadagiti ad-addangna.",
			"6": "<sup>6</sup> Iti panagsalungasing ti dakes a tao adda silo; ngem dagiti nalinteg agcancanta ken agragrag-oda.",
			"7": "<sup>7</sup> Ti nalinteg ammoenna ti biang ti napanglaw; ngem ti nadangkes awan pannacaawatna a mangammo.",
			"8": "<sup>8</sup> Dagiti mananguyaw icabilda ti ili iti gil-ayab; ngem dagiti masirib a tattao pacsiatenda ti rungsot.",
			"9": "<sup>9</sup> No ti tao a masirib makisubang iti maag, macaunget man wenno agcatawa, awanto ti inana.",
			"10": "<sup>10</sup> Dagiti mawaw iti dara cagurada ti napnoan-imbag; ngem no maipapan cadagiti nalinteg, sapulenda ti biagna.",
			"11": "<sup>11</sup> Ti maag iyesngawna amin a pungtotna; ngem ti masirib igawidna ket patalnaenna.",
			"12": "<sup>12</sup> No ti agturay ipangagna ti ulbod, amin nga ad-adipenna nadangkesda.",
			"13": "<sup>13</sup> Ti napanglaw a tao ken ti mamarigat agsaracda; ni Jehova silawanna dagiti matada a dua.",
			"14": "<sup>14</sup> Ti ari nga ocomenna a simamatalec ti napanglaw, ti tronona mapasingkedanto iti agnanayon.",
			"15": "<sup>15</sup> Ti pagbaot ken panangtubngar itdenda ti kinasirib; ngem ti inanac a mabaybay-an ibabainna ni inana.",
			"16": "<sup>16</sup> No umadu dagiti nadangkes, umadu ti salungasing; ngem dagiti nalinteg makitadanto ti pannacatnagda.",
			"17": "<sup>17</sup> Tubngarem ti anacmo, ket itdennanto kenca ti inana; wen, itdennanto ti rag-o ita cararuam.",
			"18": "<sup>18</sup> No sadino ti awanan ti sirmata, ti ili iwagsacna ti pannacatengngel; ngem ti mangsalimetmet iti linteg nagasat.",
			"19": "<sup>19</sup> Ti adipen dinto mapalinteg cadagiti sasao; ta nupay maawatanna saanna nga icancano.",
			"20": "<sup>20</sup> Makitam ti maysa a tao a nadursoc cadagiti panagsasaona? Adadda a panginanamaan iti maysa a maag ngem iti daydiay.",
			"21": "<sup>21</sup> Ti mangtaraken a sidudungngo iti adipenna manipud kinaubingna mapagbalinnanto nga anac iti camaudianan.",
			"22": "<sup>22</sup> Ti naunget a tao mamaltuad iti ringgor, ket ti narungsot a tao aglapusanan iti kinasalungasing.",
			"23": "<sup>23</sup> Ti tangsit ti tao mangipababanto kencuana; ngem ti sipapacumbaba ti espirituna maragpatnanto ti dayaw.",
			"24": "<sup>24</sup> Ti cadua ti mannanacaw guraenna ti cararuana met laeng; denggenna ti mangpasapata ket awan ti ibagana.",
			"25": "<sup>25</sup> Ti panagbuteng iti tao mangyeg iti silo; ngem ti agcammatalec ken Jehova natalgedto.",
			"26": "<sup>26</sup> Adu dagiti agbiruc iti parabur ti agturay; ngem ti pannacaocom ti tao aggapu ken Jehova.",
			"27": "<sup>27</sup> Ti managdacdakes a tao maysa a macarimon cadagiti nalinteg; ket ti sililinteg iti dalan maysa a macarimon cadagiti nadangkes."
		},
		"30": {
			"1": "<sup>1</sup> Dagiti sasao ni Agur nga anac ni Jakeh; ti mammadto. Ti lalaki cunana ken Ithiel, cada Ithiel ken Ucal:",
			"2": "<sup>2</sup> Pudno a siac naduduegac ngem iti siasinoman a tao, ket awan caniac ti pannacaawat ti tao;",
			"3": "<sup>3</sup> Ken diac sinursuro ti kinasirib, awan met caniac ti pannacaammo ti Casantoan.",
			"4": "<sup>4</sup> Siasino ti immuli sadi langit, ket immulog? Siasino ti nangacup iti angin cadagiti petpetpetna? Siasino ti nangabbeng cadagiti dandanum iti pagan-anayna? Siasino ti nangbangon cadagiti amin a pungto ti daga? Ania ti naganna, ket ania ti nagan ti anacna, no ammom?",
			"5": "<sup>5</sup> Tunggal sao ti Dios napadasen: isu ti calasag cadagiti cumamang kencuana.",
			"6": "<sup>6</sup> Dica nayonan dagiti sasaona, di la ket ta tubngarennaca, ket masaracanca a mangulbod.",
			"7": "<sup>7</sup> Dua a banag ti dinawatco kenca; dinac cadi paayen ta diac pay mapatay:",
			"8": "<sup>8</sup> Iyadayum caniac ti kinapasaw ken ululbod; dica cadi itden caniac ti kinapanglaw wenno ti kinabacnang; taraonannac iti taraon a mayanatup caniac:",
			"9": "<sup>9</sup> Di la ket ta aglaplapusananac, ket ilibacca, ken cunaec, siasino ni Jehova? Wenno di la ket ta pumanglawac, ket agtacawac, ken aramatec a sibabassawang ti nagan ti Diosco.",
			"10": "<sup>10</sup> Dica parpardayaen ti adipen iti apona, di la ket ta ilunodnaca, ket matiliwnaca a nacabasol.",
			"11": "<sup>11</sup> Adda caputotan nga ilunodda ti amada, ken dida benditoan ti inada.",
			"12": "<sup>12</sup> Adda caputotan a nadalusda cadagiti matada met laeng, ket nupay casta dida mabuggoan iti kinarugitda.",
			"13": "<sup>13</sup> Adda caputotan, O anian a nagtangsit dagiti matada! Ket dagiti calub ti matada agbucbukirad.",
			"14": "<sup>14</sup> Adda caputotan a dagiti ngipenda casda la camcampilan, ket dagiti sangida casda la im-immuco, tapno lamutenda dagiti napanglaw ditoy daga, ken dagiti nacurapay cadagiti tattao.",
			"15": "<sup>15</sup> Ti alimatec adda dua nga annacna a babbai, nga agicickis, mangtedca, mangtedca. Adda tallo a banag nga uray caanoman dida mapmapnec wen, uppat a dida cunaen, Umanayen:",
			"16": "<sup>16</sup> Ni Tanem; ken ti lupes nga aanacan; ti daga a di mapmapnec iti danum; ken ti apuy a dina cunaen, Umanayen.",
			"17": "<sup>17</sup> Ti mata a mangrabrabac ken amana, ken umsienna ti agtulnog ken inana, dagiti wac ti lobong sippitendanto nga iruar, ket dagiti urbon nga aguila sidaendanto.",
			"18": "<sup>18</sup> Adda tallo a banag a nacascasdaaw unay caniac, wen, uppat a diac ammo:",
			"19": "<sup>19</sup> Ti dalan ti aguila iti tangatang; ti dalan ti uleg iti rabaw iti bato; ti dalan ti sasacayan iti tengnga ti taaw; ken ti dalan ti lalaki iti balasang.",
			"20": "<sup>20</sup> Castoy ti dalan ti babai a makicamalala; mangan, ammusayanna ti ngiwatna, ket cunana, Awan kinadangkes nga inaramidco.",
			"21": "<sup>21</sup> Tallo a banag ti pagkintayegan toy daga, ken uppat, a dina mabalin nga ibturen:",
			"22": "<sup>22</sup> Gapu iti maysa nga adipen no isu agari; ken ti maysa a maag no mabsog iti taraon;",
			"23": "<sup>23</sup> Gapu iti nacaluclucsao a babai no maasawaan; ken ti maysa a adipen a balasang no agtawid iti apona a babai.",
			"24": "<sup>24</sup> Adda uppat a kita a babassitda ditoy daga, ngem napalaloda a nagsirib:",
			"25": "<sup>25</sup> Dagiti cotcoton saanda nga umili a napigsa, nupay casta paaddaenda ti taraonda iti calgaw;",
			"26": "<sup>26</sup> Dagiti conconejo nacapuyda laeng a bonggoy, nupay casta aramidenda dagiti balbalayda cadagiti batbato;",
			"27": "<sup>27</sup> Dagiti duddudon awan arida, nupay casta agasacda la amin a pinangenpangen;",
			"28": "<sup>28</sup> Ti alutiit cumebkeb cadagiti sacsacana, nupay casta adda cadagiti palacio dagiti ari.",
			"29": "<sup>29</sup> Adda tallo a kita a nalimbongda cadagiti pannagnada, wen, uppat ket di a nalimbongda iti panagpapanda:",
			"30": "<sup>30</sup> Ti leon, a capigsaan cadagiti an-animal, ket dina pagtuckiadan ti siasinoman;",
			"31": "<sup>31</sup> Ti aso a paganup; ti calding a bulog castamet; ken ti ari nga awan ti macabalin nga umalsa kencuana.",
			"32": "<sup>32</sup> No minamaag ti inaramidmo a panangitan-ocmo ita bagim met laeng, wenno, nagpanggepca iti dakes, iyappotmo ta imam ita ngiwatmo.",
			"33": "<sup>33</sup> Ta ti panangbatir iti gatas pataudenna ti mantequilla, ket ti panangtiritir iti agong pagdaringongoenna; casta met ti manggargari iti pungtot pataudenna ti ringgor."
		},
		"31": {
			"1": "<sup>1</sup> Dagiti sasao ni Ari Lemuel; ti padto nga insuro kencuana ni inana.",
			"2": "<sup>2</sup> Ania, anacco? Ket ania, O anac toy tianco? Ket ania, O anac dagiti carcaric?",
			"3": "<sup>3</sup> Dica itden ta pigsam cadagiti babbai, casta met dagiti dalanmo iti macadadael cadagiti ari.",
			"4": "<sup>4</sup> Saan a maipaay cadagiti ar-ari, O Lemuel, saan a maipaay cadagiti ar-ari ti panaginum iti arac; saan met a maipaay cadagiti piprincipe ti panagcuna, Sadino ti ayan ti naingel nga inumen?",
			"5": "<sup>5</sup> Di la ket ta uminumda, ket malipatanda ti linteg, ket killoenda ti kinajusticia iti siasinoman a mapaldaangan.",
			"6": "<sup>6</sup> Iccam iti naingel nga inumen daydiay nganngani mapucawen, ken arac iti daydiay sipapait ti cararuana:",
			"7": "<sup>7</sup> Bay-am ta uminum, ket malipatanna ti kinapanglawna, ket dina coma malagipen ti kinay-ay-ayna.",
			"8": "<sup>8</sup> Lucatam ta ngiwatmo nga iservim iti umel, iti pacaringgoran dagiti amin a mapaspasia.",
			"9": "<sup>9</sup> Luctam ta ngiwatmo, mangocomca a sililinteg, ken salimetmetam ti kinajusticia cadagiti napanglaw ken nacurapay.",
			"10": "<sup>10</sup> Ti natalunggadingan a babai asino ti macasarac? Ta ti pategna nangatngato ngem rubrubi.",
			"11": "<sup>11</sup> Ti puso ti asawana sitatalec kencuana, ket saanto a macurangan iti magunguna.",
			"12": "<sup>12</sup> Ni babai mangipaayto kencuana iti naimbag a saan ket a dakes cadagiti amin nga al-aldaw ti panagbiagna.",
			"13": "<sup>13</sup> Isu agbiruc iti de lana ken lino. Ket aramidenna a siaayat cadagiti im-imana.",
			"14": "<sup>14</sup> Arig la cadagiti sasacayan ti lumalaco: paaddaenna ti tinapayna manipud iti adayu.",
			"15": "<sup>15</sup> Bumangon met no rabii pay laeng, ket iccanna iti canen ti familiana, ken iti aramidenda cadagiti tagabuna a babbai.",
			"16": "<sup>16</sup> Panpanunotenna ti maysa a talon, ket gatangenna; iti gapuanan dagiti im-imana macamula iti maysa nga inuvasan.",
			"17": "<sup>17</sup> Baricsanna dagiti lomona iti kinabileg, ket papigsaenna dagiti tackiagna.",
			"18": "<sup>18</sup> Maricnana a ti tagilacona magungunaan; ti pagsilawanna saan a maiddep nga agpatnag.",
			"19": "<sup>19</sup> Iyiggemna dagiti imana iti rueda, ket dagiti imana captenda ti tacbian.",
			"20": "<sup>20</sup> Iyucradna ti daculapna cadagiti napanglaw; wen, iyunnatna dagiti imana cadagiti nacurapay.",
			"21": "<sup>21</sup> Saan nga agbuteng iti nieve a maipaay iti familiana; ta dagup ti familiana sipapagan-anay iti escarlata.",
			"22": "<sup>22</sup> Agaramid iti agservi kencuana met laeng nga apap a napuscol; ti pagan-anayna nalapat a lienzo ken purpura.",
			"23": "<sup>23</sup> Ni asawana mabigbig cadagiti ruruangan, no makipagtugaw cadagiti panglacayen iti daga.",
			"24": "<sup>24</sup> Agaramid cadagiti cawcawes a lienzo ket ilacona ida, ken agyawat cadagiti barbarikes iti lumalaco.",
			"25": "<sup>25</sup> Kinabileg ken kinatacneng ti pagcawesna; ket pagcatawaanna ti pannawen a dumteng.",
			"26": "<sup>26</sup> Luctanna ti ngiwatna a buyugen ti kinasirib; ket ti linteg ti kinamanagayat adda iti dilana.",
			"27": "<sup>27</sup> Imatanganna a nalaing dagiti daldalan ti familiana, ket saan a mangan iti tinapay ti kinasadut.",
			"28": "<sup>28</sup> Dagiti annacna bumangonda, ket naganenda a naingasatan; ti met asawana, ket idaydayawna a cuncuna:",
			"29": "<sup>29</sup> Adu nga inanac a babai nagaramidda a maicari unay, ngem sica atiwem amin ida.",
			"30": "<sup>30</sup> Ti imnas mangallilaw, ket ti kinasaya-at ubbaw; ngem ti babai nga agbuteng ken ni Jehova maidaydayawto.",
			"31": "<sup>31</sup> Iccam iti gapuanan dagiti im-imana; ket dagiti aramidna mangidaydayawda coma kencuana cadagiti ruruangan."
		}
	}
};
module.exports = book;